#include <iostream>
#include <vector>
using namespace std;
void solve(int N, int K) {
vector<int> segmentTree;
int index = 1;
auto init = [&](int node, int s, int e) {
if (s == e) return segmentTree[node] = 1;
int mid = (s + e) / 2;
return segmentTree[node] = init(2 * node, s, mid) + init(2 * node + 1, mid + 1, e);
};
auto update = [&](int node, int s, int e, int del) {
segmentTree[node]--;
if (s == e) return 0;
else {
int mid = (s + e) / 2;
if (del <= mid) return update(2 * node, s, mid, del);
else return update(2 * node + 1, mid + 1, e, del);
}
};
auto query = [&](int node, int s, int e, int order) {
if (s == e) return;
int mid = (s + e) / 2;
if (order <= segmentTree[2 * node]) return query(2 * node, s, mid, order);
else return query(2 * node + 1, mid + 1, e, order - segmentTree[2 * node]);
};
init(1, 1, N);
cout << "<";
for (int i = 0; i < N; i++) {
int size = N - i;
index += K - 1;
if (index % size == 0) index = size;
else if (index > size) index %= size;
int num = query(1, 1, N, index);
update(1, 1, N, num);
if (i == N - 1) cout << num;
else cout << num << ", ";
}
cout << ">";
}
int main() {
ios_base::sync_with_stdio(0);
cin.tie(NULL);
int N, K;
cin >> N >> K;
solve(N, K);
return 0;
}

#include <iostream>
#include <vector>
#include <queue>
#include <algorithm>
using namespace std;
#define MAX_N 801
#define INF 987654321
int N, P;
int cap[MAX_N][MAX_N], flow[MAX_N][MAX_N];
vector<int> adj[MAX_N];
int edmondsKarp() {
int source = 1, sink = 2;
int totalFlow = 0;
while (1) {
queue<int> q;
vector<int> parent(MAX_N, -1);
q.push(source);
parent[source] = source;
while (!q.empty()) {
int cur = q.front();
q.pop();
if (cur == sink) break;
for (int next : adj[cur]) {
if (cap[cur][next] - flow[cur][next] > 0 && parent[next] == -1) {
q.push(next);
parent[next] = cur;
}
}
}
if (parent[sink] == -1) break;
int minFlow = INF;
for (int i = sink; i != source; i = parent[i]) {
minFlow = min(minFlow, cap[parent[i]][i] - flow[parent[i]][i]);
}
for (int i = sink; i != source; i = parent[i]) {
flow[parent[i]][i] += minFlow;
flow[i][parent[i]] -= minFlow;
}
totalFlow += minFlow;
}
return totalFlow;
}
int main() {
cin >> N >> P;
for (int i = 1; i <= N; i++) {
adj[i].push_back(i + N);
adj[i + N].push_back(i);
cap[i][i + N] = 1;
}
for (int i = 0; i < P; i++) {
int from, to;
cin >> from >> to;
adj[from + N].push_back(to);
adj[to].push_back(from + N);
cap[from + N][to] = 1;
adj[to + N].push_back(from);
adj[from].push_back(to + N);
cap[to + N][from] = 1;
}
int ans = edmondsKarp();
cout << ans << endl;
return 0;
}

#include<iostream>
#include<cstring>
using namespace std;
#define MAX 101
int N, M, K;
char MAP[MAX][MAX];
int DP[MAX][MAX][80];
string Dest;
int Dest_Len;
int dx[] = { 0, 0, 1, -1 };
int dy[] = { 1, -1, 0, 0 };
void Input(){
cin >> N >> M >> K;
for (int i = 0; i < N; i++) {
for (int j = 0; j < M; j++) {
cin >> MAP[i][j];
}
}
cin >> Dest;
Dest_Len = Dest.length();
memset(DP, -1, sizeof(DP));
}
int DFS(int x, int y, int Idx){
if (DP[x][y][Idx] != -1) return DP[x][y][Idx];
if (Idx >= Dest_Len) return 1;
DP[x][y][Idx] = 0;
for (int i = 0; i < 4; i++) {
for (int k = 1; k <= K; k++) {
int nx = x + dx[i] * k;
int ny = y + dy[i] * k;
if (nx < 0 || ny < 0 || nx >= N || ny >= M) continue;
if (MAP[nx][ny] != Dest[Idx]) continue;
DP[x][y][Idx] = DP[x][y][Idx] + DFS(nx, ny, Idx + 1);
}
}
return DP[x][y][Idx];
}
void Solution(){
char Temp = Dest[0];
int Answer = 0;
for (int i = 0; i < N; i++) {
for (int j = 0; j < M; j++) {
if (MAP[i][j] == Temp) {
Answer = Answer + DFS(i, j, 1);
}
}
}
cout << Answer << endl;
}
int main(void){
ios::sync_with_stdio(false);
cin.tie(NULL);
cout.tie(NULL);
Solve();
return 0;
}

