tree[idx] = delta;
idx /= 2;
while (idx >= 1) {
if (tree[idx * 2] > tree[idx * 2 + 1])
tree[idx] = tree[idx * 2 + 1];
else
tree[idx] = tree[idx * 2];
idx /= 2;
}
