#include <iostream>
#include <algorithm>
#include <vector>
using namespace std;
class SegmentTree {
public:
SegmentTree() {}
int update(int node, int start, int end, int index, int num) {
if (index < start || index > end) {
return mTree[node];
} else if (start == end) {
mTree[node] += num;
return mTree[node];
}
int mid = (start + end) / 2;
mTree[node] = update(node * 2, start, mid, index, num) + update(node * 2 + 1, mid + 1, end, index, num);
return mTree[node];
}
int query(int node, int start, int end, int num) {
if (start == end) {
return start;
}
int mid = (start + end) / 2;
if (mTree[node * 2] >= num) {
return query(node * 2, start, mid, num);
} else {
return query(node * 2 + 1, mid + 1, end, num - mTree[node * 2]);
}
}
private:
int mTree[65536 * 4];
};
int main() {
ios::sync_with_stdio(false);
cin.tie(NULL);
cout.tie(NULL);
