for (int i = 0; i < K; i++) {
seg.update(1, 0, 65536, arr[i], 1);
}
long long ans = seg.query(1, 0, 65536, (K + 1) / 2);
for (int i = K; i < N; i++) {
seg.update(1, 0, 65536, arr[i], 1);
seg.update(1, 0, 65536, arr[i - K], -1);
int mid = seg.query(1, 0, 65536, (K + 1) / 2);
ans += mid;
}
cout << ans << "\n";
return 0;
}

