#include <stack>
using namespace std;
int N, Q;
vector<int> parent;
stack<pair<int, pair<int, int>>> st;
stack<string> ans;
int find(int x) {
if (parent[x] == x)
return x;
return parent[x] = find(parent[x]);
}
void merge(int x, int y) {
x = find(x);
y = find(y);
if (x != y)
parent[y] = x;
}
void solve() {
parent[1] = 1;
while (!st.empty()) {
int op = st.top().first;
if (op == 0) {
int b = st.top().second.first;
merge(b, parent[b]);
}
else {
int c = st.top().second.first;
int d = st.top().second.second;
if (find(c) == find(d))
ans.push("YES");
else
ans.push("NO");
}
st.pop();
}
while (!ans.empty()) {
cout << ans.top() << endl;
ans.pop();
}
}
