}
void bfs() {
int answer = INF;
pii start = {0,0};
queue<State> que;
que.push({start,0});
visited[start] = 1;
while(!que.empty()) {
pii now = que.front().st;
int now_cnt = que.front().cnt;
que.pop();
pii next;
if(now.first == C && now.second == D) {
answer = min(answer, now_cnt);
}
next = {A, now.second};
if(!visited[next]) {
visited[next] = 1;
que.push({next, now_cnt + 1});
}
next = {now.first, B};
if(!visited[next]) {
visited[next] = 1;
que.push({next, now_cnt + 1});
}
next = {0, now.second};
if(!visited[next]) {
visited[next] = 1;
que.push({next, now_cnt + 1});
}
next = {now.first, 0};
if(!visited[next]) {
visited[next] = 1;
que.push({next, now_cnt + 1});
}
int b_left = B - now.second;
if(now.first >= b_left)
next = {now.first - b_left, B};
else
next = {0, now.first + now.second};
if(!visited[next]) {
visited[next] = 1;
que.push({next, now_cnt + 1});
}
int a_left = A - now.first;
if(now.second >= a_left)
next = {A, now.second - a_left};
else
next = {now.first + now.second, 0};
