#include <iostream>
#include <vector>
using namespace std;
int N;
vector<vector<int>> arr;
vector<vector<int>> bit;
void update(int y, int x, int value) {
while (y <= N) {
int j = x;
while (j <= N) {
bit[y][j] += value;
j += (j & -j);
}
y += (y & -y);
}
}
int sum(int y, int x) {
int s = 0;
while (y > 0) {
int j = x;
while (j > 0) {
s += bit[y][j];
j -= (j & -j);
}
y -= (y & -y);
}
return s;
}
int main() {
ios_base::sync_with_stdio(false);
cin.tie(NULL);
cout.tie(NULL);
cin >> N;
arr.resize(N + 1, vector<int>(N + 1));
bit.resize(N + 1, vector<int>(N + 1));
for (int i = 1; i <= N; i++) {
for (int j = 1; j <= N; j++) {
cin >> arr[i][j];
update(i, j, arr[i][j]);
}
}
