if(hundred == 9) {
ans += "CM";
} else if(hundred == 4) {
ans += "CD";
} else if(hundred == 5) {
ans += "D";
} else if(hundred == 1) {
ans += "C";
} else if(hundred < 4) {
while(hundred--) ans += 'C';
} else if(hundred > 5) {
ans += 'D';
for(int i=0; i<hundred-5; i++) ans += 'C';
}
}
case 2: {
num %= 100;
int tenth = num / 10;
if(tenth == 9) {
ans += "XC";
} else if(tenth == 4) {
ans += "XL";
} else if(tenth == 5) {
ans += "L";
} else if(tenth == 1) {
ans += "X";
} else if(tenth < 4) {
while(tenth--) ans += 'X';
} else if(tenth > 5) {
ans += 'L';
for(int i=0; i<tenth-5; i++) ans += 'X';
}
}
case 1: {
num %= 10;
if(num == 9) {
ans += "IX";
} else if(num == 4) {
ans += "IV";
} else if(num == 5) {
ans += "V";
} else if(num < 4) {
while(num--) ans += 'I';
} else if(num > 5) {
ans += 'V';
for(int i=0; i<num-5; i++) ans += 'I';
}
break;
}
default:
break;
}
return ans;
}
