struct Point {
int x, y;
Point(int x, int y) : x(x), y(y) {}
};
bool cmpY(const Point& a, const Point& b) {
return a.y > b.y;
}
bool cmp(const Point& a, const Point& b) {
return a.x < b.x || (a.x == b.x && a.y < b.y);
}
vector<Point> arr;
vector<int> compressed;
vector<int> seg;
void compress() {
sort(arr.begin(), arr.end(), cmpY);
compressed.clear();
int rank = -1, prev = INT_MAX;
for (const Point& p : arr) {
if (prev != p.y) {
rank++;
}
compressed.push_back(rank);
prev = p.y;
}
sort(arr.begin(), arr.end(), cmp);
}
int query(int cur, int left, int right, int qlo, int qhi) {
if (right < qlo || qhi < left) {
return 0;
}
if (qlo <= left && right <= qhi) {
return seg[cur];
}
int mid = (left + right) / 2;
int leftSum = query(cur * 2, left, mid, qlo, qhi);
int rightSum = query(cur * 2 + 1, mid + 1, right, qlo, qhi);
return leftSum + rightSum;
}
void update(int cur, int left, int right, int pos) {
if (right < pos || pos < left) {
return;
}
if (left == right) {
seg[cur]++;
return;
}
int mid = (left + right) / 2;
update(cur * 2, left, mid, pos);
update(cur * 2 + 1, mid + 1, right, pos);
seg[cur] = seg[cur * 2] + seg[cur * 2 + 1];
}
long long solve() {
long long answer = 0;
seg.clear();
seg.resize(arr.size() * 4 + 4, 0);
for (const Point& p : arr) {
answer += query(1, 0, compressed.size() - 1, 0, p.y);
update(1, 0, compressed.size() - 1, p.y);
}
return answer;
}
