#include <iostream>
#include <vector>
#include <algorithm>
using namespace std;
vector<int> tree[400001];
void update(int pos, int val, int node, int left, int right) {
if (pos < left || pos > right)
return;
tree[node].push_back(val);
int mid = (left + right) / 2;
if (left != right) {         update(pos, val, node * 2, left, mid);
update(pos, val, node * 2 + 1, mid + 1, right);
}
}
int query(int L, int R, int node, int k, int left, int right) {
if (R < left || right < L)
return 0;
if (L <= left && right <= R)
return tree[node].end() - upper_bound(tree[node].begin(), tree[node].end(), k);
int mid = (left + right) / 2;
return query(L, R, node * 2, k, left, mid) + query(L, R, node * 2 + 1, k, mid + 1, right);
}
int main() {
ios_base::sync_with_stdio(0);
cin.tie(0);
int N;
cin >> N;
for (int i = 1; i <= N; i++) {
int temp;
cin >> temp;
update(i, temp, 1, 1, N);     }
for (int i = 0; i <= N * 4; i++)
sort(tree[i].begin(), tree[i].end());
int M;
cin >> M;
while (M--) {
int i, j, k;
cin >> i >> j >> k;
cout << query(i, j, 1, k, 1, N) << "\n";
}
