using namespace std;
#define MAX 100
int N;
char Map[MAX][MAX];
int Dist[MAX][MAX][4];
pair<int, int> Start, End;
queue<pair<pair<int, int>, int>> Q;
int dx[] = {0, 1, 0, -1};
int dy[] = {1, 0, -1, 0};
pair<int, int> getNext(int dir) {
int nx, ny;
if (dir == 0) {
nx = Start.first - 1;
ny = Start.second;
}
else if (dir == 1) {
nx = Start.first;
ny = Start.second + 1;
}
else if (dir == 2) {
nx = Start.first + 1;
ny = Start.second;
}
else {
nx = Start.first;
ny = Start.second - 1;
}
return make_pair(nx, ny);
}
void BFS() {
while (!Q.empty()) {
int x = Q.front().first.first;
int y = Q.front().first.second;
int dir = Q.front().second;
Q.pop();
if (x == End.first && y == End.second) {
return;
}
int nx, ny;
nx = x + dx[dir];
ny = y + dy[dir];
if (nx < 0 || ny < 0 || nx >= N || ny >= N) {
continue;
}
if (Map[nx][ny] == '.') {
if (Dist[nx][ny][dir] > Dist[x][y][dir]) {
Dist[nx][ny][dir] = Dist[x][y][dir];
Q.push(make_pair(make_pair(nx, ny), dir));
}
}
else if (Map[nx][ny] == '#') {
continue;
}
else if (Map[nx][ny] == '!') {
if (Dist[nx][ny][dir] > Dist[x][y][dir]) {
Dist[nx][ny][dir] = Dist[x][y][dir];
Q.push(make_pair(make_pair(nx, ny), dir));
}
pair<int, int> next1 = getNext((dir + 1) % 4);
pair<int, int> next2 = getNext((dir + 3) % 4);
if (Dist[next1.first][next1.second][dir] > Dist[x][y][dir] + 1) {
Dist[next1.first][next1.second][dir] = Dist[x][y][dir] + 1;
Q.push(make_pair(next1, dir));
}
if (Dist[next2.first][next2.second][dir] > Dist[x][y][dir] + 1) {
Dist[next2.first][next2.second][dir] = Dist[x][y][dir] + 1;
Q.push(make_pair(next2, dir));
}
}
}
}
