#include <iostream>
#include <vector>
using namespace std;
int N, M;
vector<int> arr, tree, lazy;
int init(int node, int start, int end) {
if (start == end) {
return tree[node] = arr[start];
}
int mid = (start + end) / 2;
return tree[node] = init(node * 2, start, mid) ^ init(node * 2 + 1, mid + 1, end);
}
void propa(int node, int start, int end) {
if (lazy[node] != 0) {
if ((end - start + 1) % 2 == 1) {
tree[node] ^= lazy[node];
}
if (start != end) {
lazy[node * 2] ^= lazy[node];
lazy[node * 2 + 1] ^= lazy[node];
}
lazy[node] = 0;
}
}
void update(int node, int start, int end, int left, int right, int val) {
propa(node, start, end);
if (right < start || end < left) return;
if (left <= start && end <= right) {
lazy[node] ^= val;
propa(node, start, end);
return;
}
int mid = (start + end) / 2;
update(node * 2, start, mid, left, right, val);
update(node * 2 + 1, mid + 1, end, left, right, val);
tree[node] = tree[node * 2] ^ tree[node * 2 + 1];
}
int query(int node, int start, int end, int left, int right) {
propa(node, start, end);
if (right < start || end < left) return 0;
if (left <= start && end <= right) {
return tree[node];
}
int mid = (start + end) / 2;
int res1 = query(node * 2, start, mid, left, right);
int res2 = query(node * 2 + 1, mid + 1, end, left, right);
return res1 ^ res2;
}
int main() {
ios_base::sync_with_stdio(false);
cin.tie(NULL);
cin >> N;
arr.resize(N + 1);
tree.resize(4 * N + 1);
lazy.resize(4 * N + 1);
for (int i = 1; i < N + 1; i++) {
cin >> arr[i];
}
init(1, 1, N);
cin >> M;
int op, a, b, c;
for (int i = 0; i < M; i++) {
cin >> op;
if (op == 1) {
cin >> a >> b >> c;
update(1, 1, N, a + 1, b + 1, c);
} else {
cin >> a >> b;
cout << query(1, 1, N, a + 1, b + 1) << "\n";
}
}
return 0;
}

