#include <cmath>
#include <algorithm>
using namespace std;
double rangeSum(const vector<long long>& psum, int a, int b) {
if (a == 0) return psum[b];
return psum[b] - psum[a - 1];
}
double standardDeviation(const vector<long long>& sqpsum, const vector<long long>& psum, int a, int b) {
double mean = rangeSum(psum, a, b) / static_cast<long double>(b - a + 1);
double ret = rangeSum(sqpsum, a, b) - 2 * mean * rangeSum(psum, a, b) + (b - a + 1) * mean * mean;
double variance = ret / (b - a + 1);
return sqrt(variance);
}
int main() {
int N, K;
cin >> N >> K;
vector<long long> subsumList;
vector<long long> sqSubsumList;
int tmp;
long long sum = 0;
long long sqSum = 0;
for (int i = 0; i < N; i++) {
cin >> tmp;
sum += tmp;
sqSum += static_cast<long long>(tmp) * tmp;
subsumList.push_back(sum);
sqSubsumList.push_back(sqSum);
}
double min_v = numeric_limits<double>::max();
for (int s = 0; s < N; s++) {
for (int e = s + K - 1; e < N; e++) {
min_v = min(min_v, standardDeviation(sqSubsumList, subsumList, s, e));
}
}
cout << min_v << endl;
return 0;
}

