using namespace std;
const int INF = -1e9;
int n, m;
vector<int> arr;
vector<vector<int>> cache;
int prefixSum(int start, int end) {
int sum = 0;
for (int i = start; i <= end; i++) {
sum += arr[i];
}
return sum;
}
int dp(int idx, int rem) {
if (rem == 0) return 0;
if (idx < 0) return INF;
if (cache[idx][rem] != INF) return cache[idx][rem];
int result = dp(idx - 1, rem);
for (int i = idx; i >= 0; i--) {
int currSum = prefixSum(i, idx);
int tmp = dp(i - 2, rem - 1) + currSum;
result = max(result, tmp);
}
cache[idx][rem] = result;
return result;
}
int main() {
