int start_idx;
stack<char> pre;
for(int i=0;i<inputLength/2;i++){
pre.push(input[i]);
}
if(inputLength%2==0){
start_idx = inputLength/2;
while(!pre.empty()){
if(pre.top()!=input[start_idx++])
return false;
else{
pre.pop();
}
}
}
else{
start_idx = inputLength/2+1;
while(!pre.empty()){
if(pre.top()!=input[start_idx++])
return false;
else{
pre.pop();
}
}
}
return true;
}
