vector<int> arr;
int N;
long long solve(int start, int end) {
if (start == end) return (long long) arr[start] * arr[start];
int mid = (start + end) / 2;
long long ans1 = solve(start, mid);
long long ans2 = solve(mid + 1, end);
int left = mid, right = mid + 1;
int sum = arr[left] + arr[right];
int minVal = min(arr[left], arr[right]);
long long tempMaxScore = (long long) sum * minVal;
while (left > start || right < end) {
if (right < end && (left == start || arr[left - 1] < arr[right + 1])) {
sum += arr[++right];
minVal = min(minVal, arr[right]);
} else {
sum += arr[--left];
minVal = min(minVal, arr[left]);
}
tempMaxScore = max(tempMaxScore, (long long) sum * minVal);
}
return max({ans1, ans2, tempMaxScore});
}
