adjs[a][b] = true;
adjs[b][a] = true;
}
FloydWarshall();
calcPassingTime();
vector<int> leaders = pickLeaders();
sort(leaders.begin(), leaders.end());
cout << leaders.size() << "\n";
for (auto leader : leaders)
cout << leader << "\n";
return 0;
}

