char Q;
while (scanf("%d%d", &N, &K) != EOF) {
vector<int> Tree;
vector<pair<char, pair<int, int>>> Query;
Tree.resize(4 * N + 1);
for (int i = 1; i <= N; i++) {
scanf("%d", &Value);
if (Value > 0) Value = 1;
else if (Value < 0) Value = -1;
updateTree(Tree, 1, 1, N, i, Value);
}
for (int i = 0; i < K; i++) {
char a;
int b, c;
scanf(" %c %d %d", &a, &b, &c);
Query.push_back({a, {b, c}});
}
for (int i = 0; i < K; i++) {
