unordered_set<ll> hashmap;
queue<pair<ll, string>> q;
q.push({s, ""});
while(!q.empty()) {
ll cur = q.front().first;
string str = q.front().second;
q.pop();
if (cur == t) {
flag = true;
cout << str;
return;
}
ll next = cur * cur;
if (hashmap.find(next) == hashmap.end()) {
hashmap.insert(next);
q.push({cur * cur, str + "*"});
}
next = cur + cur;
if (hashmap.find(next) == hashmap.end()) {
hashmap.insert(next);
q.push({cur + cur, str + "+"});
}
next = cur - cur;
if (hashmap.find(next) == hashmap.end()) {
hashmap.insert(next);
q.push({cur - cur, str + "-"});
}
if (cur != 0) {
next = cur / cur;
if (hashmap.find(next) == hashmap.end()) {
hashmap.insert(next);
q.push({cur / cur, str + "/"});
}
}
}
}
