int solve(int N, int L, int P, vector<pair<int, int>>& fuel) {
priority_queue<int> pq;
int idx = 0, cnt = 0;
while (L > P) {
while (fuel[idx].first <= P && idx < N) {
pq.push(fuel[idx].second);
idx++;
}
if (!pq.empty()) {
P += pq.top();
pq.pop();
cnt++;
}
else if (idx == N || fuel[idx].first > P) {
cnt = -1;
break;
}
}
return cnt;
}
