board[cnt+1][i][j] = real_board[base[cnt]][i][j];
}
}
cnt++;
}
}
void rotate(int which) {
int tmp[6][6] = { 0 };
for (int i = 1; i <= 5; i++)
for (int j = 1; j <= 5; j++)
tmp[i][j] = board[which][i][j];
for (int i = 1; i <= 5; i++)
for (int j = 1; j <= 5; j++)
board[which][6 - j][i] = tmp[i][j];
}
int bfs(int a, int b, int c) {
if (!board[1][1][1] || !board[5][5][5])return INF;
queue <struct xyz> q;
for (int i = 1; i <= 5; i++) {
for (int j = 1; j <= 5; j++) {
for (int k = 1; k <= 5; k++)
d[i][j][k] = INF;
}
}
q.push({ a,b,c });
d[1][1][1] = 0;
while (!q.empty()) {
int x = q.front().x;
int y = q.front().y;
int z = q.front().z;
int tmp = d[z][x][y];
q.pop();
for (int i = 0; i < 6; i++) {
int nx = x + dx[i];
int ny = y + dy[i];
int nz = z + dz[i];
if (1 <= nx && nx <= 5 && 1 <= ny && ny <= 5 && 1 <= nz && nz <= 5) {
if (board[nz][nx][ny] == 1 && d[nz][nx][ny] > tmp+1) {
d[nz][nx][ny] = tmp+1;
q.push({ nz,nx,ny });
}
}
}
}
return d[5][5][5];
}
void dfs(int cnt) {
