tenmodk[i] = powermodk(10, i);
for (int i = 0; i < n; ++i) {
int pre = 0;
for (int j = 0; j < seq[i].size(); ++j)
pre = (pre * 10 + (seq[i][j] - '0')) % k;
seqmodk[i] = pre;
}
dp[0][0] = 1;
