length = 2 * length + k + 3;
}
int midLength = (length - k - 3) / 2;
int t = (length - midLength) / 2;
if (n <= t) {
midLength--;
length = t;
}
else if (n > t + midLength) {
n -= (t + midLength);
midLength--;
length = t;
}
