#include <iostream>
#include <vector>
#include <stack>
using namespace std;
int N, M;
vector<vector<int>> adj;
vector<vector<int>> trans_adj;
vector<vector<int>> SCC;
vector<int> discovered;
vector<int> sccid;
stack<int> stk;
int vertex_cnt, scc_cnt;
int SCCDFS(int now) {
int ret = discovered[now] = vertex_cnt++;
stk.push(now);
for (auto& next : adj[now]) {
if (discovered[next] == -1) {
ret = min(ret, SCCDFS(next));
}
else if (sccid[next] == -1) {
ret = min(ret, discovered[next]);
}
}
if (ret == discovered[now]) {
vector<int> scc;
while (1) {
int temp = stk.top();
stk.pop();
scc.push_back(temp);
sccid[temp] = scc_cnt;
if (temp == now) break;
}
SCC.push_back(scc);
scc_cnt++;
}
return ret;
}
void init() {
adj.clear();
trans_adj.clear();
discovered.clear();
sccid.clear();
SCC.clear();
vertex_cnt = scc_cnt = 0;
cin >> N >> M;
adj.resize(N + 1, vector<int>());
trans_adj.resize(N + 1, vector<int>());
discovered.resize(N + 1, -1);
sccid.resize(N + 1, -1);
int u, v;
for (int i = 0; i < M; i++) {
cin >> u >> v;
adj[u].push_back(v);
trans_adj[v].push_back(u);
}
}
void solve() {
for (int i = 1; i <= N; i++) {
if (discovered[i] != -1) continue;
SCCDFS(i);
}
vector<int> in_degree(scc_cnt, 0);
for (int i = 1; i <= N; i++) {
for (auto& w : adj[i]) {
if (sccid[w] == sccid[i]) continue;
in_degree[sccid[w]]++;
}
}
int result = 0;
for (int i = 0; i < scc_cnt; i++) {
if (in_degree[i] == 0) result++;
}
cout << result << "\n";
}
int main() {
ios::sync_with_stdio(0), cin.tie(0);
int test;
cin >> test;
while (test--) {
init();
solve();
}
return 0;
}

