#include <iostream>
#include <algorithm>
#include <cstring>
#define INF 987654321
using namespace std;
int dp[3][10001];
int N, W, enemy[2][10001];
void solve(void) {
for (int i = 2; i <= N; i++) {
int outer = 2 - (enemy[0][i] + enemy[0][i - 1] <= W);
int inner = 2 - (enemy[1][i] + enemy[1][i - 1] <= W);
int horizon = 2 - (enemy[0][i] + enemy[1][i] <= W);
dp[0][i] = min(dp[2][i - 1] + 1, dp[1][i - 1] + outer);
dp[1][i] = min(dp[2][i - 1] + 1, dp[0][i - 1] + inner);
dp[2][i] = min({dp[2][i - 1] + horizon, dp[0][i] + 1, dp[1][i] + 1, dp[2][i - 2] + outer + inner});
}
return;
}
int main() {
ios::sync_with_stdio(0);
cin.tie(0);
cout.tie(0);
int T;
cin >> T;
while (T--) {
cin >> N >> W;
for (int i = 0; i < 2; i++)
for (int j = 1; j <= N; j++)
cin >> enemy[i][j];
if (N == 1) {
cout << 2 - (enemy[0][1] + enemy[1][1] <= W) << '\n';
continue;
}
int ans = INF;
memset(dp, 0, sizeof(dp));
dp[0][1] = dp[1][1] = 1;
dp[2][1] = 2 - (enemy[0][1] + enemy[1][1] <= W);
solve();
ans = min(ans, dp[2][N]);
if (enemy[0][N] + enemy[0][1] <= W) {
dp[2][0] = INF;
dp[0][1] = 1;
dp[1][1] = INF;
dp[2][1] = 2;
solve();
ans = min(ans, dp[1][N]);
}
if (enemy[1][N] + enemy[1][1] <= W) {
dp[2][0] = INF;
dp[1][1] = 1;
dp[0][1] = INF;
dp[2][1] = 2;
solve();
ans = min(ans, dp[0][N]);
}
if (enemy[0][N] + enemy[0][1] <= W && enemy[1][N] + enemy[1][1] <= W) {
dp[2][0] = INF;
dp[0][1] = dp[1][1] = INF;
dp[2][1] = 2;
solve();
ans = min(ans, dp[2][N - 1]);
}
cout << ans << '\n';
}
return 0;
}

