bool visited[2][MAX+1];
int main() {
int N, K;
cin >> N >> K;
int answer = -1;
int time = 0;
queue<pair<int, int>> q;
q.push(make_pair(N, 0));
visited[0][N] = true;
while (!q.empty()) {
int size = q.size();
int nk = K + (time * (time + 1) / 2);
if (nk < 0 || nk > MAX) {
break;
}
while (size--) {
int curX = q.front().first;
int curTime = q.front().second;
q.pop();
if (curX == nk && visited[time % 2][nk]) {
answer = time;
goto END;
}
if (curX - 1 >= 0 && !visited[(curTime + 1) % 2][curX - 1]) {
q.push(make_pair(curX - 1, curTime + 1));
visited[(curTime + 1) % 2][curX - 1] = true;
}
if (curX + 1 <= MAX && !visited[(curTime + 1) % 2][curX + 1]) {
q.push(make_pair(curX + 1, curTime + 1));
visited[(curTime + 1) % 2][curX + 1] = true;
}
if (curX * 2 <= MAX && !visited[(curTime + 1) % 2][curX * 2]) {
q.push(make_pair(curX * 2, curTime + 1));
visited[(curTime + 1) % 2][curX * 2] = true;
}
}
time++;
}
END:
