#define SIZE 30
const int INF = 2000000000;
using namespace std;
typedef long long int ll;
struct Trie{
Trie* node[SIZE];
int alpha_cnt;
bool is_finish, is_child;
Trie(){
fill(node, node+SIZE, nullptr);
alpha_cnt = 0;
is_finish = is_child = false;
}
~Trie(){
for(int i=0; i<SIZE; i++){
if(node[i])
delete node[i];
}
}
void insert(const string& word, int index){
if(index >= word.size()){
is_finish = true;
return;
}
else if(index < word.size()){
int word_index = word[index] - 'a';
if(node[word_index] == NULL){
alpha_cnt++;
is_child = true;
node[word_index] = new Trie();
}
node[word_index]->insert(word, index+1);
}
}
int find(const string& word, int index, int cnt){
if(index >= word.size()){
return cnt;
}
int res = 0;
int word_index = word[index] - 'a';
if(index != 0 && (alpha_cnt != 1 || (alpha_cnt == 1 && is_finish == true)) && node[word_index] != NULL){
res = node[word_index]->find(word, index+1, cnt+1);
}
else{
res = node[word_index]->find(word, index+1, cnt);
}
return res;
}
};
