#define INF LLONG_MAX
using namespace std;
typedef long long ll;
typedef pair<ll, int> pli;
int N, M, K;
vector<pair<int, ll>> city[10001];
ll dist[10001][21];
ll dijkstra() {
for(int i=1; i<=N; i++) {
for(int j=0; j<=K; j++) {
dist[i][j] = INF;
}
}
priority_queue<pli, vector<pli>, greater<pli>> pq;
pq.push({0, 1});
dist[1][0] = 0;
while(!pq.empty()) {
ll cost = pq.top().first;
int cur = pq.top().second;
pq.pop();
if(dist[cur][K] < cost) continue;
for(auto next : city[cur]) {
int nxt = next.first;
ll nxtCost = cost + next.second;
if(dist[nxt][K] > nxtCost) {
dist[nxt][K] = nxtCost;
pq.push({nxtCost, nxt});
}
for(int i=0; i<K; i++) {
if(dist[nxt][i] > cost) {
dist[nxt][i] = cost;
pq.push({cost, nxt});
}
}
}
}
ll minDist = INF;
for(int i=0; i<=K; i++) {
minDist = min(minDist, dist[N][i]);
}
return minDist;
}
