#include <iostream>
#include <queue>
#include <vector>
using namespace std;
int N;
char map[50][50];
bool visited[2][50][50];
struct Pos {
int y, x, shape;
};
queue<Pos> q;
int dy[] = { -1, 1, 0, 0, 0 };
int dx[] = { 0, 0, -1, 1, 0 };
bool isInside(int y, int x) {
return y >= 0 && y < N && x >= 0 && x < N;
}
bool canMove(int y, int x, int shape) {
if (!visited[shape][y][x] && isInside(y, x) && map[y][x] != '1') {
return true;
}
return false;
}
bool bfs(Pos start, Pos end) {
visited[start.shape][start.y][start.x] = true;
q.push(start);
while (!q.empty()) {
int y = q.front().y;
int x = q.front().x;
int shape = q.front().shape;
q.pop();
if (y == end.y && x == end.x && shape == end.shape) {
return true;
}
for (int i = 0; i < 5; i++) {
int ny = y + dy[i];
int nx = x + dx[i];
int nshape = shape;
if (i == 4) {                 if (shape == 0) {                     if (isInside(ny, nx - 1) && isInside(ny, nx + 1) && map[ny][nx - 1] != '1' && map[ny][nx + 1] != '1') {
nshape = 1;
}
} else {                     if (isInside(ny - 1, nx) && isInside(ny + 1, nx) && map[ny - 1][nx] != '1' && map[ny + 1][nx] != '1') {
nshape = 0;
}
}
}
if (canMove(ny, nx, nshape)) {
visited[nshape][ny][nx] = true;
q.push({ ny, nx, nshape });
}
}
}
return false;
}
int main() {
ios::sync_with_stdio(false);
cin.tie(0);
cin >> N;
Pos start, end;
for (int i = 0; i < N; i++) {
for (int j = 0; j < N; j++) {
cin >> map[i][j];
if (map[i][j] == 'B') {
if (start.shape == -1) {
start = { i, j, -1 };
} else {
start.shape = (i == start.y) ? 0 : 1;
}
} else if (map[i][j] == 'E') {
if (end.shape == -1) {
end = { i, j, -1 };
} else {
end.shape = (i == end.y) ? 0 : 1;
}
}
}
}
if (bfs(start, end)) {
cout << "1\n";
} else {
cout << "0\n";
}
return 0;
}

