int N, M;
int board[50][50];
vector<int> order;
int dx[] = { 0, 1, 0, -1 };
int dy[] = { -1, 0, 1, 0 };
void blizzard(int d, int s) {
int x = N / 2;
int y = N / 2;
for (int i = 1; i <= s; ++i) {
x += dx[d];
y += dy[d];
board[x][y] = 0;      }
}
void destroyBeads() {
vector<int> tmp;
while (!order.empty()) {
int dir = order.back();
order.pop_back();
int x = N / 2;
int y = N / 2;
for (int i = 0; i < s; ++i) {
x += dx[dir];
y += dy[dir];
tmp.push_back(board[x][y]);
}
}
int idx = 0;
while (idx < tmp.size()) {
int cnt = 0;
int cur = tmp[idx];
while (idx < tmp.size() && tmp[idx] == cur) {
++cnt;
++idx;
}
if (cnt >= 4) {
for (int i = 0; i < cnt; ++i) {
tmp.pop_back();
}
}
}
int tmpIdx = 0;
while (!order.empty()) {
int dir = order.back();
order.pop_back();
int x = N / 2;
int y = N / 2;
for (int i = 0; i < s; ++i) {
x += dx[dir];
y += dy[dir];
if (tmpIdx < tmp.size()) {
board[x][y] = tmp[tmpIdx++];
} else {
board[x][y] = 0;
}
}
}
}
void moveBeads() {
vector<int> tmp;
while (!order.empty()) {
int dir = order.back();
order.pop_back();
int x = N / 2;
int y = N / 2;
for (int i = 0; i < s; ++i) {
x += dx[dir];
y += dy[dir];
tmp.push_back(board[x][y]);
}
}
int idx = 0;
while (idx < tmp.size()) {
int cnt = 0;
int cur = tmp[idx];
while (idx < tmp.size() && tmp[idx] == cur) {
++cnt;
++idx;
}
order.push_back(cnt);
order.push_back(cur);
}
while (order.size() < N * N) {
order.push_back(0);
}
int tmpIdx = 0;
while (!order.empty()) {
int dir = order.back();
order.pop_back();
int x = N / 2;
int y = N / 2;
for (int i = 0; i < s; ++i) {
x += dx[dir];
y += dy[dir];
if (tmpIdx < tmp.size()) {
board[x][y] = tmp[tmpIdx++];
} else {
board[x][y] = 0;
}
}
}
}
int main() {
cin >> N >> M;
for (int i = 0; i < N; ++i) {
for (int j = 0; j < N; ++j) {
cin >> board[i][j];
}
}
int d, s;
for (int i = 0; i < M; ++i) {
cin >> d >> s;
blizzard(d - 1, s);
destroyBeads();
moveBeads();
}
int answer = 0;
int cnt = 1;
for (int i = 0; i < N; ++i) {
for (int j = 0; j < cnt; ++j) {
answer += board[i][j];
}
if (i < N / 2) {
cnt++;
} else {
cnt--;
}
}
cout << answer << endl;
return 0;
}

