using namespace std;
bool canWin(int n, vector<vector<int>>& board) {
vector<vector<bool>> visited(n, vector<bool>(n, false));
queue<pair<int, int>> q;
q.push(make_pair(0, 0));
visited[0][0] = true;
while (!q.empty()) {
int x = q.front().first;
int y = q.front().second;
q.pop();
if (board[x][y] == -1) {
return true;
}
int jump = board[x][y];
if (y + jump < n && !visited[x][y + jump]) {
q.push(make_pair(x, y + jump));
visited[x][y + jump] = true;
}
if (x + jump < n && !visited[x + jump][y]) {
q.push(make_pair(x + jump, y));
visited[x + jump][y] = true;
}
}
return false;
}
