#include <iostream>
#include <cstring>
#include <string>
#include <algorithm>
using namespace std;
const int INF = 987654321;
const int MAX = 17;
int N, P, cnt;
int cost[MAX][MAX];
int dp[1 << MAX];
string s;
int go(int mask) {
int& ret = dp[mask];
if (ret != -1) return ret;
if (cnt >= P) return ret = 0;
ret = INF;
cnt++;
for (int i = 0; i < N; i++) {
if (mask & (1 << i)) {
for (int j = 0; j < N; j++) {
if (!(mask & (1 << j))) {
ret = min(ret, go(mask | (1 << j)) + cost[i][j]);
}
}
}
}
cnt--;
return ret;
}
int main() {
memset(dp, -1, sizeof(dp));
cin >> N;
for (int i = 0; i < N; i++) {
for (int j = 0; j < N; j++) {
cin >> cost[i][j];
}
}
cin >> s;
cin >> P;
int mask = 0;
int cnt = 0;
for (int i = 0; i < s.size(); i++) {
if (s[i] == 'Y') {
mask |= (1 << i);
cnt++;
}
}
int result = go(mask);
if (result == INF) {
cout << -1 << endl;
} else {
cout << result << endl;
}
return 0;
}

