#include<iostream>
#include<vector>
#include<queue>
#include<cstring>
using namespace std;
const int INF = 987654321;
int n;
int c[52][52]; int f[52][52]; vector<int> graph[52];
int charToInt(char c) {
if (c >= 'A' && c <= 'Z')
return c - 'A';
return c - 'a' + 26;
}
int maxFlow(int source, int sink) {
int totalFlow = 0;
while (true) {
int parent[52];
memset(parent, -1, sizeof(parent));
queue<int> q;
q.push(source);         while (!q.empty() && parent[sink] == -1) {
int cur = q.front();
q.pop();
for (int next : graph[cur]) {
if (c[cur][next] - f[cur][next] > 0 && parent[next] == -1) {                     q.push(next);
parent[next] = cur;                     if (next == sink)
break;
}
}
}
if (parent[sink] == -1)             break;
int flow = INF;
for (int i = sink; i != source; i = parent[i])
flow = min(flow, c[parent[i]][i] - f[parent[i]][i]);
for (int i = sink; i != source; i = parent[i]) {
f[parent[i]][i] += flow;             f[i][parent[i]] -= flow;         }
totalFlow += flow;     }
return totalFlow;
}
int main() {
ios_base::sync_with_stdio(false);
cin.tie(NULL);
cin >> n;
for (int i = 0; i < n; i++) {
char u, v;
int w;
cin >> u >> v >> w;
int u_idx = charToInt(u);
int v_idx = charToInt(v);
c[u_idx][v_idx] += w;
c[v_idx][u_idx] += w;
graph[u_idx].push_back(v_idx);
graph[v_idx].push_back(u_idx);
}
int source = charToInt('A');
int sink = charToInt('Z');
cout << maxFlow(source, sink) << "\n";
return 0;
}

