string addStrings(string num1, string num2) {
string res = "";
int carry = 0;
int idx1 = num1.size() - 1;
int idx2 = num2.size() - 1;
while (idx1 >= 0 || idx2 >= 0) {
int n1 = idx1 >= 0 ? num1[idx1] - '0' : 0;
int n2 = idx2 >= 0 ? num2[idx2] - '0' : 0;
int sum = n1 + n2 + carry;
carry = sum / 10;
res += to_string(sum % 10);
idx1--;
idx2--;
}
if (carry > 0) {
res += to_string(carry);
}
reverse(res.begin(), res.end());
return res;
}
