q.push(make_tuple(0, 0, 0, 1));
while(!q.empty()){
int r, c, wall;
bool sun;
tie(r, c, wall, sun) = q.front();
q.pop();
if(r == n-1 && c == m-1){
ans = min(ans, v[r][c][wall][sun]);
