typedef pair<int, int> pii;
const int MAX = 1001;
const int INF = 987654321;
int N, M, A, B, C;
vector<pii> adj[MAX];
set<pii> dijkstra() {
set<pii> ret;
vector<int> d(N + 1, INF);
vector<int> before(N + 1);
priority_queue<pii, vector<pii>, greater<pii>> pq;
for (int i = 0; i <= N; i++)
before[i] = i;
d[1] = 0;
pq.push({0, 1});
while (!pq.empty()) {
int currD = pq.top().first;
int curr = pq.top().second;
pq.pop();
if (currD > d[curr])
continue;
for (auto x : adj[curr]) {
int next = x.first;
int w = x.second;
if (d[curr] + w < d[next]) {
d[next] = d[curr] + w;
before[next] = curr;
pq.push({d[next], next});
}
}
}
for (int i = 1; i <= N; i++) {
int p = i;
while (p != before[p]) {
ret.insert({min(p, before[p]), max(p, before[p])});
p = before[p];
}
}
return ret;
}
