using namespace std;
char cave[101][101];
int R, C;
int cluster[101][101];
vector<int> throwList;
int dx[] = {-1, 1, 0, 0};
int dy[] = {0, 0, -1, 1};
bool isInRange(int x, int y) {
return x >= 0 && x < R && y >= 0 && y < C;
}
void printCave() {
for(int i=0; i<R; i++) {
for(int j=0; j<C; j++) {
cout << cave[i][j];
}
cout << endl;
}
cout << endl;
}
void throwSticks(int height, char dir) {
if(dir == 'L') {
for(int i=0; i<C; i++) {
if(cave[height][i] == 'x') {
cave[height][i] = '.';
break;
}
}
}
else if(dir == 'R') {
for(int i=C-1; i>=0; i--) {
if(cave[height][i] == 'x') {
cave[height][i] = '.';
break;
}
}
}
}
void breakCluster(int x, int y) {
queue<pair<int, int>> q;
q.push(make_pair(x, y));
cluster[x][y] = 0;
while(!q.empty()) {
int currX = q.front().first;
int currY = q.front().second;
q.pop();
for(int i=0; i<4; i++) {
int nx = currX + dx[i];
int ny = currY + dy[i];
if(isInRange(nx, ny) && cave[nx][ny] == 'x' && cluster[nx][ny] == -1) {
cluster[nx][ny] = 0;
q.push(make_pair(nx, ny));
}
}
}
}
bool isFloatingCluster() {
memset(cluster, -1, sizeof(cluster));
for(int i=0; i<C; i++) {
if(cave[R-1][i] == 'x' && cluster[R-1][i] == -1) {
breakCluster(R-1, i);
}
}
bool floating = true;
for(int i=0; i<R; i++) {
for(int j=0; j<C; j++) {
if(cave[i][j] == 'x' && cluster[i][j] == -1) {
floating = false;
break;
}
}
}
return floating;
}
void moveCluster(int height) {
int lowest = R-1;
for(int i=0; i<R; i++) {
for(int j=0; j<C; j++) {
if(cave[i][j] == 'x' && cluster[i][j] != -1) {
cave[i][j] = '.';
lowest = min(lowest, i);
}
}
}
int dropHeight = R-1;
for(int i=lowest; i>=0; i--) {
for(int j=0; j<C; j++) {
if(cave[i][j] == 'x' && cluster[i][j] != -1) {
int ny = j;
int nx = i+1;
if(isInRange(nx, ny) && cave[nx][ny] == '.') {
cave[nx][ny] = 'x';
cluster[i][j] = -1;
dropHeight = min(dropHeight, nx);
}
}
}
}
if(dropHeight != R-1) {
for(int i=0; i<R; i++) {
for(int j=0; j<C; j++) {
if(cave[i][j] == 'x' && cluster[i][j] != -1) {
cave[i][j] = '.';
}
}
}
for(int i=0; i<R; i++) {
for(int j=0; j<C; j++) {
if(cave[i][j] == 'x' && cluster[i][j] != -1) {
cave[i+dropHeight-R+1][j] = 'x';
}
}
}
}
}
void solve() {
for(int i=0; i<throwList.size(); i++) {
int height = R - throwList[i];
if(i % 2 == 0) {
for(int j=0; j<C; j++) {
if(cave[height][j] == 'x') {
cave[height][j] = '.';
break;
}
}
}
else {
for(int j=C-1; j>=0; j--) {
if(cave[height][j] == 'x') {
cave[height][j] = '.';
break;
}
}
}
if(isFloatingCluster()) {
moveCluster(height);
}
}
}
int main() {
