q.pop();
for(int i=0;i<a[x].size();i++){
Edge y = Edge(a[x][i].node, a[x][i].time);
if(result[y.node] <= y.time + result[x]){
result[y.node] = y.time + result[x];
}
if(--inDegree[y.node] == 0){
q.push(y.node);
}
}
}
int count = 0;
