int y = q.front();
q.pop();
for(int i=0;i<b[y].size();i++){
Edge x = Edge(b[y][i].node, b[y][i].time);
if(result[y] - result[x.node] == x.time){
count++;
if(c[x.node] == 0){
q.push(x.node);
c[x.node] = 1;
}
}
}
}
