int mid = (start + end) / 2;
ll left_sum = init_tree(node * 2, start, mid);
ll right_sum = init_tree(node * 2 + 1, mid + 1, end);
return tree[node] = left_sum + right_sum;
}
ll query(int node, int start, int end, int left, int right) {
if (end < left || start > right) {
return 0;
}
if (left <= start && end <= right) {
return tree[node];
}
int mid = (start + end) / 2;
ll left_sum = query(node * 2, start, mid, left, right);
ll right_sum = query(node * 2 + 1, mid + 1, end, left, right);
return left_sum + right_sum;
}
void update(int node, int start, int end, int index, ll diff) {
if (index < start || index > end) {
return;
}
tree[node] += diff;
if (start == end) {
return;
}
int mid = (start + end) / 2;
update(node * 2, start, mid, index, diff);
update(node * 2 + 1, mid + 1, end, index, diff);
}
int main() {
int n, m;
cin >> n >> m;
arr.resize(n);
tree.resize(n * 4);
for (int i = 0; i < n; i++) {
arr[i] = 0;
}
init_tree(1, 0, n - 1);
for (int i = 0; i < m; i++) {
int op, a, b;
cin >> op >> a >> b;
if (op == 0) {
if (a > b) {
swap(a, b);
}
cout << query(1, 0, n - 1, a - 1, b - 1) << '\n';
} else {
ll diff = b - arr[a - 1];
arr[a - 1] = b;
update(1, 0, n - 1, a - 1, diff);
}
}
return 0;
}

