}
}
}
}
void Make_Wall_MAP() {
for (int i = 0; i < Wall_V.size(); i++) {
int x = Wall_V[i].first;
int y = Wall_V[i].second;
int Time = 1;
while (1) {
int nx = x + 1;
int ny = y;
if (nx >= MAX) break;
Wall_MAP[Time][nx][ny] = '#';
Time++;
x = nx;
y = ny;
}
}
}
bool Can_Finish(int x, int T) {
for (int i = x - 1; i >= 0; i--) {
for (int j = 0; j < MAX; j++) {
if (Wall_MAP[T][i][j] == '#') return false;
}
}
return true;
}
int BFS(int a, int b) {
queue<pair<pair<int, int>, int>> Q;
