void FloydWarshall(int n) {
for (int k = 1; k <= n; k++) {
for (int i = 1; i <= n; i++) {
for (int j = 1; j <= n; j++) {
if (map[i][j] > map[i][k] + map[k][j]) {
map[i][j] = map[i][k] + map[k][j];
nxt[i][j] = nxt[i][k];
}
}
}
}
}
vector<int> findPath(int start, int end) {
vector<int> path;
int current = start;
while (current != end) {
path.push_back(current);
current = nxt[current][end];
}
path.push_back(current);
return path;
}
