const int MAX = 100001;
int N, K;
int parent[MAX][17], dist[MAX][17], minDist[MAX][17], maxDist[MAX][17], depth[MAX];
bool visited[MAX];
vector<pair<int, int>> graph[MAX];
void DFS(int node, int d) {
visited[node] = true;
depth[node] = d;
for (int i = 0; i < graph[node].size(); i++) {
int next = graph[node][i].first;
int cost = graph[node][i].second;
if (!visited[next]) {
parent[next][0] = node;
dist[next][0] = cost;
minDist[next][0] = cost;
maxDist[next][0] = cost;
DFS(next, d + 1);
}
}
}
void LCA() {
for (int j = 1; j < 17; j++) {
for (int i = 1; i <= N; i++) {
parent[i][j] = parent[parent[i][j-1]][j-1];
dist[i][j] = dist[i][j-1] + dist[parent[i][j-1]][j-1];
minDist[i][j] = min(minDist[i][j-1], minDist[parent[i][j-1]][j-1]);
maxDist[i][j] = max(maxDist[i][j-1], maxDist[parent[i][j-1]][j-1]);
}
}
}
pair<int, int> query(int x, int y) {
int minD = INF;
int maxD = 0;
if (depth[x] > depth[y]) swap(x, y);
for (int i = 16; i >= 0; i--) {
if (depth[y] - depth[x] >= (1 << i)) {
minD = min(minD, minDist[y][i]);
maxD = max(maxD, maxDist[y][i]);
y = parent[y][i];
}
}
if (x == y) return make_pair(minD, maxD);
for (int i = 16; i >= 0; i--) {
if (parent[x][i] != parent[y][i]) {
minD = min(minD, min(minDist[x][i], minDist[y][i]));
maxD = max(maxD, max(maxDist[x][i], maxDist[y][i]));
x = parent[x][i];
y = parent[y][i];
}
}
minD = min(minD, min(minDist[x][0], minDist[y][0]));
maxD = max(maxD, max(maxDist[x][0], maxDist[y][0]));
return make_pair(minD, maxD);
}
int main() {
