cin.tie(0);
cin >> N;
for (int i = 0; i < N - 1; i++) {
int a, b, c;
cin >> a >> b >> c;
graph[a].push_back({b, c});
graph[b].push_back({a, c});
}
memset(parent, 0, sizeof(parent));
memset(dist, 0, sizeof(dist));
memset(minDist, INF, sizeof(minDist));
DFS(1, 0);
LCA();
cin >> K;
