bool operator<(const Block& b) const {
if (cnt == b.cnt) {
if (rainbowCnt == b.rainbowCnt) {
if (x == b.x) return y < b.y;
return x < b.x;
}
return rainbowCnt < b.rainbowCnt;
}
return cnt < b.cnt;
}
};
int N, M;
int board[MAX][MAX];
int dx[] = { 0, 0, -1, 1 };
int dy[] = { -1, 1, 0, 0 };
int score = 0;
void input();
bool findBlock();
void applyGravity();
void rotateBoard();
int main() {
