for (int i = 0; i < N; i++) {
for (int j = 0; j < N; j++) {
cin >> board[i][j];
}
}
}
bool findBlock() {
bool visit[MAX][MAX] = { false, };
priority_queue<Block> pQ;
for (int i = 0; i < N; i++) {
for (int j = 0; j < N; j++) {
if (board[i][j] > 0 && !visit[i][j]) {
bool rainbowVisit[MAX][MAX] = { false, };
queue<pair<int, int>> Q;
Q.push({ i, j });
visit[i][j] = true;
int cnt = 1, rainbowCnt = 0;
while (!Q.empty()) {
int x = Q.front().first;
int y = Q.front().second;
Q.pop();
for (int d = 0; d < 4; d++) {
int nx = x + dx[d];
int ny = y + dy[d];
if (nx < 0 || nx >= N || ny < 0 || ny >= N || visit[nx][ny] || rainbowVisit[nx][ny]) continue;
if (board[nx][ny] == 0) {
rainbowVisit[nx][ny] = true;
Q.push({ nx, ny });
cnt++;
rainbowCnt++;
}
else if (board[i][j] == board[nx][ny]) {
visit[nx][ny] = true;
Q.push({ nx, ny });
cnt++;
}
}
}
pQ.push({ i, j, cnt, rainbowCnt });
}
}
}
if (pQ.empty()) return false;
int x = pQ.top().x;
int y = pQ.top().y;
int cnt = pQ.top().cnt;
if (cnt < 2) return false;
score += cnt * cnt;     queue<pair<int, int>> Q;
Q.push({ x, y });
int blockId = board[x][y];
board[x][y] = -2;
while (!Q.empty()) {
int x = Q.front().first;
int y = Q.front().second;
Q.pop();
for (int d = 0; d < 4; d++) {
int nx = x + dx[d];
int ny = y + dy[d];
if (nx < 0 || nx >= N || ny < 0 || ny >= N) continue;
if (board[nx][ny] == 0 || board[nx][ny] == blockId) {
Q.push({ nx, ny });
board[nx][ny] = -2;
}
}
}
return true;
}
void applyGravity() {
for (int i = 0; i < N; i++) {
for (int j = N - 1; j >= 0; j--) {
if (board[j][i] == -2) {
int x = j;
int y = i;
while (x > 0 && board[x][y] == -2) x--;
if (board[x][y] == -1) continue;
board[j][i] = board[x][y];
board[x][y] = -2;
}
}
}
}
void rotateBoard() {
int tempBoard[MAX][MAX];
for (int i = 0; i < N; i++) {
for (int j = 0; j < N; j++) {
tempBoard[i][j] = board[i][j];
}
}
for (int i = 0; i < N; i++) {
for (int j = 0; j < N; j++) {
board[i][j] = tempBoard[j][N - 1 - i];
}
}
}

