using namespace std;
struct Point {
int x, y;
};
struct Line {
Point p1, p2;
};
int ccw(Point a, Point b, Point c) {
int tmp = a.x * b.y + b.x * c.y + c.x * a.y - (a.y * b.x + b.y * c.x + c.y * a.x);
if (tmp > 0) return 1;
if (tmp < 0) return -1;
return 0;
}
bool isIntersect(Line l1, Line l2) {
int ccw1 = ccw(l1.p1, l1.p2, l2.p1);
int ccw2 = ccw(l1.p1, l1.p2, l2.p2);
int ccw3 = ccw(l2.p1, l2.p2, l1.p1);
int ccw4 = ccw(l2.p1, l2.p2, l1.p2);
if (ccw1 * ccw2 == 0 && ccw3 * ccw4 == 0) {
if (l1.p1.x == l1.p2.x) {
int max1 = max(l1.p1.y, l1.p2.y);
int min1 = min(l1.p1.y, l1.p2.y);
int max2 = max(l2.p1.y, l2.p2.y);
int min2 = min(l2.p1.y, l2.p2.y);
if (max1 >= min2 && max2 >= min1) return true;
else return false;
}
int max1 = max(l1.p1.x, l1.p2.x);
int min1 = min(l1.p1.x, l1.p2.x);
int max2 = max(l2.p1.x, l2.p2.x);
int min2 = min(l2.p1.x, l2.p2.x);
if (max1 >= min2 && max2 >= min1) return true;
return false;
}
if (ccw1 * ccw2 <= 0 && ccw3 * ccw4 <= 0) return true;
return false;
}
int findParent(vector<int>& parent, int x) {
if (parent[x] == x) return x;
parent[x] = findParent(parent, parent[x]);
return parent[x];
}
void unionParent(vector<int>& parent, int x, int y) {
int px = findParent(parent, x);
int py = findParent(parent, y);
if (px <= py) parent[py] = px;
else parent[px] = py;
}
int main() {
