if (visited[y][x]) return true;
for (int i = -1; i <= 1; i++) {
for (int j = -1; j <= 1; j++) {
int ny = y + i;
int nx = x + j;
if (visited[ny][nx]) return true;
}
}
return false;
}
int calculateCost(int y, int x) {
int cost = 0;
for (int i = -1; i <= 1; i++) {
for (int j = -1; j <= 1; j++) {
int ny = y + i;
int nx = x + j;
visited[ny][nx] = true;
cost += cost[ny][nx];
}
}
return cost;
}
void dfs(int y, int x, int depth, int totalCost) {
if (depth == 3) {
result = min(result, totalCost);
return;
}
for (int i = 1; i < N - 1; i++) {
for (int j = 1; j < N - 1; j++) {
if (check(i, j)) continue;
int currentCost = calculateCost(i, j);
dfs(i, j, depth + 1, totalCost + currentCost);
for (int k = -1; k <= 1; k++) {
for (int l = -1; l <= 1; l++) {
int ny = i + k;
int nx = j + l;
visited[ny][nx] = false;
}
}
}
}
}
