#define MAX 40001
using namespace std;
int N, M, max_height;
int depth[MAX];
vector<pair<int,int>> graph[MAX];
bool visited[MAX];
int parent[MAX][30];
int dist[MAX][30];
void dfs(int node, int _depth) {
visited[node] = 1;
depth[node] = _depth;
for (auto next : graph[node]) {
if (visited[next.first]) continue;
parent[next.first][0] = node;
dist[next.first][0] = next.second;
dfs(next.first, _depth + 1);
}
}
void set_parent() {
for (int i = 1; i < max_height; i++) {
for (int k = 1; k <= N; k++) {
int prev_parent = parent[k][i - 1];
parent[k][i] = parent[prev_parent][i - 1];
if (parent[prev_parent][i - 1] == 0) continue;
dist[k][i] = dist[k][i - 1] + dist[prev_parent][i - 1];
}
}
}
int lca(int a, int b) {
int _dist = 0;
if (depth[a] > depth[b]) swap(a, b);
for (int i = max_height; i >= 0; i--) {         int diff = depth[b] - depth[a];
int jump = 1 << i;
if (jump <= diff) {
_dist += dist[b][i];
b = parent[b][i];
}
}
if (a == b) return _dist;
for (int i = max_height; i >= 0; i--) {         if (parent[a][i] != parent[b][i]) {
_dist += dist[a][i];
a = parent[a][i];
_dist += dist[b][i];
b = parent[b][i];
}
}
_dist += dist[a][0] + dist[b][0];     return _dist;
}
