while (temp > 0) {
max_height++;
temp = temp >> 1;
}
for (int i = 0; i < N - 1; i++) {
int a, b, c;
cin >> a >> b >> c;
graph[a].push_back({b, c});         graph[b].push_back({a, c});     }
dfs(1, 0);
