pair<ll,ll> D;
cin >> A.first >> A.second;
cin >> B.first >> B.second;
cin >> C.first >> C.second;
cin >> D.first >> D.second;
if(isOverlapped(A,B,C,D)){
cout << 1;
}
else{
cout << 0;
}
