#define MAX 1000
#define R_INF -987654321
using namespace std;
int N, M;
int MAP[MAX][MAX];
int Cost[MAX][MAX][3];
bool Visit[MAX][MAX];
int dx[] = { 0, 0, 1 };
int dy[] = { 1, -1, 0 };
int Bigger(int A, int B) {
if (A > B) return A;
return B;
}
void Input() {
cin >> N >> M;
for (int i = 0; i < N; i++) {
for (int j = 0; j < M; j++) {
cin >> MAP[i][j];
}
}
}
int DFS(int x, int y, int Dir) {
if (x == N - 1 && y == M - 1) return MAP[x][y];
if (Cost[x][y][Dir] != R_INF) return Cost[x][y][Dir];
Visit[x][y] = true;
int Biggest_Value = R_INF;
for (int i = 0; i < 3; i++) {
int nx = x + dx[i];
int ny = y + dy[i];
if (nx >= 0 && ny >= 0 && nx < N && ny < M) {
if (Visit[nx][ny] == false) {
Biggest_Value = Bigger(Biggest_Value, DFS(nx, ny, i));
}
}
}
Visit[x][y] = false;
Cost[x][y][Dir] = MAP[x][y] + Biggest_Value;
return Cost[x][y][Dir];
}
void Solution() {
for (int i = 0; i < N; i++) {
for (int j = 0; j < M; j++) {
Cost[i][j][0] = R_INF;
Cost[i][j][1] = R_INF;
Cost[i][j][2] = R_INF;
}
}
int Answer = DFS(0, 0, 0);
cout << Answer << endl;
}
void Solve() {
Input();
Solution();
}
int main(void) {
