using namespace std;
class Point {
public:
int x, y;
Point(int _x, int _y) : x(_x), y(_y) {}
bool operator<(const Point& v) const {
if (y == v.y) {
return x < v.x;
} else {
return y < v.y;
}
}
};
int dist(Point p1, Point p2) {
return (p1.x - p2.x) * (p1.x - p2.x) + (p1.y - p2.y) * (p1.y - p2.y);
}
bool cmp(const Point& u, const Point& v) {
return u.x < v.x;
}
int main() {
ios_base::sync_with_stdio(0);
cin.tie(0);
int N;
cin >> N;
vector<Point> vec;
int a, b;
for (int i = 0; i < N; i++) {
cin >> a >> b;
vec.push_back(Point(a, b));
}
sort(vec.begin(), vec.end(), cmp);
int minDist = dist(vec[0], vec[1]);
set<Point> s;
s.insert(vec[0]);
s.insert(vec[1]);
int start = 0;
for (int i = 2; i < N; i++) {
Point nowP = vec[i];
while (start < i) {
Point p = vec[start];
int gap = nowP.x - p.x;
if (gap * gap > minDist) {
s.erase(p);
start++;
} else {
break;
}
}
int sqrtMinDist = (int)(sqrt((double)minDist) + 1);
auto up = s.upper_bound(Point(100000, nowP.y + sqrtMinDist));
auto low = s.lower_bound(Point(-100000, nowP.y - sqrtMinDist));
while (low != up) {
int tmpDist = dist(nowP, *low);
if (tmpDist < minDist) {
minDist = tmpDist;
}
low++;
}
s.insert(nowP);
}
cout << minDist << "\n";
return 0;
}

