int y = graph[x][i];
if(d[y] == 0)
parent = min(parent, dfs(y));
else if(!finished[y])
parent = min(parent, d[y]);
}
if(parent == d[x]){
vector<int> scc;
while(1){
int t = s.top();
s.pop();
scc.push_back(t);
finished[t] = true;
if(t == x)
break;
}
sort(scc.begin(), scc.end());
SCC.push_back(scc);
}
return parent;
}
