int result;
int dx[] = {0, 0, 1, -1};
int dy[] = {1, -1, 0, 0};
bool Select[25];
bool MoreThanFour(vector<string>& arr) {
int Cnt = 0;
for (int i = 0; i < 25; i++) {
if (Select[i] == true) {
int x = i / 5;
int y = i % 5;
if (arr[x][y] == 'S') Cnt++;
}
}
if (Cnt >= 4) return true;
else return false;
}
bool Adjacency(vector<string>& arr) {
queue<pair<int, int>> Q;
bool Check_Select[5][5];
bool Queue_Select[5][5];
bool Check_Answer = false;
memset(Queue_Select, false, sizeof(Queue_Select));
memset(Check_Select, false, sizeof(Check_Select));
int Tmp = 0;
for (int i = 0; i < 25; i++) {
if (Select[i] == true) {
int x = i / 5;
int y = i % 5;
Check_Select[x][y] = true;
if (Tmp == 0) {
Q.push(make_pair(x, y));
Queue_Select[x][y] = true;
Tmp++;
}
}
}
int Cnt = 1;
while (!Q.empty()) {
int x = Q.front().first;
int y = Q.front().second;
Q.pop();
if (Cnt == 7) {
Check_Answer = true;
break;
}
for (int i = 0; i < 4; i++) {
int nx = x + dx[i];
int ny = y + dy[i];
if (nx >= 0 && ny >= 0 && nx < 5 && ny < 5) {
if (Check_Select[nx][ny] == true && Queue_Select[nx][ny] == false) {
Queue_Select[nx][ny] = true;
Q.push(make_pair(nx, ny));
Cnt++;
}
}
}
}
if (Check_Answer == true) return true;
return false;
}
void DFS(int Idx, int Cnt, vector<string>& arr) {
if (Cnt == 7) {
if (MoreThanFour(arr) == true) {
if (Adjacency(arr) == true) result++;
}
return;
}
for (int i = Idx; i < 25; i++) {
if (Select[i] == true) continue;
Select[i] = true;
DFS(i, Cnt + 1, arr);
Select[i] = false;
}
}
