#include <iostream>
#include <vector>
void solve(int n, std::vector<int>& count) {
int start = 1;
int tenPower = 1;
while (start <= n) {
while (start % 10 != 0 && start <= n) {
for (int i = start; i > 0; i /= 10) {
count[i % 10] += tenPower;
}
start++;
}
if (n < start) {
return;
}
while (n % 10 != 9 && start <= n) {
for (int i = n; i > 0; i /= 10) {
count[i % 10] += tenPower;
}
n--;
}
start /= 10;
n /= 10;
for (int i = 0; i < 10; i++) {
count[i] += (n - start + 1) * tenPower;
}
tenPower *= 10;
}
}
int main() {
std::ios::sync_with_stdio(false);
std::cin.tie(NULL);
std::cout.tie(NULL);
int n;
std::cin >> n;
std::vector<int> count(10);
solve(n, count);
for (int i = 0; i < 10; i++) {
std::cout << count[i] << " ";
}
return 0;
}

