for(int i = 1; i <= m; i++){
Customer customer;
cin >> customer.startRow >> customer.startCol >> customer.endRow >> customer.endCol;
customerInfo.push_back(customer);
}
while(customerInfo.size()){
if(goToDestination() == -1){ cout << -1; return 0; }
if(goToDestination(1) == -1){ cout << -1; return 0; };
customerInfo.erase(customerInfo.begin());
}
cout << fuel;
}

#include <iostream>
#include <vector>
using namespace std;
typedef long long ll;
vector<ll> arr;
vector<ll> tree;
ll initTree(int node, int start, int end) {
if (start == end) {
return tree[node] = arr[start];
}
int mid = (start + end) / 2;
return tree[node] = initTree(node * 2, start, mid) + initTree(node * 2 + 1, mid + 1, end);
}
ll calcSum(int node, int start, int end, int left, int right) {
if (left > end || right < start) {
return 0;
}
if (left <= start && right >= end) {
return tree[node];
}
int mid = (start + end) / 2;
return calcSum(node * 2, start, mid, left, right) + calcSum(node * 2 + 1, mid + 1, end, left, right);
}
void updateTree(int node, int start, int end, int index, ll diff) {
if (index < start || index > end) {
return;
}
tree[node] += diff;
if (start != end) {
int mid = (start + end) / 2;
updateTree(node * 2, start, mid, index, diff);
updateTree(node * 2 + 1, mid + 1, end, index, diff);
}
}
int main() {
ios_base::sync_with_stdio(false);
cin.tie(0);
int N, Q;
cin >> N >> Q;
arr.resize(N);
for (int i = 0; i < N; i++) {
cin >> arr[i];
}
tree.resize(4 * N);
initTree(1, 0, N - 1);
for (int i = 0; i < Q; i++) {
int x, y, a, b;
cin >> x >> y >> a >> b;
if (x > y) {
swap(x, y);
}
cout << calcSum(1, 0, N - 1, x - 1, y - 1) << "\n";
ll diff = b - arr[a - 1];
arr[a - 1] = b;
updateTree(1, 0, N - 1, a - 1, diff);
}
return 0;
}

