int left, right;
left = 0;
right = s.size() - 1;
while (left < right){
if (s[left] != s[right]){
if (check == 0){
int len = right - left;
if (palindrome(s.substr(left + 1, len), 1) == 0 || palindrome(s.substr(left, len), 1) == 0)
return 1;                 else
return 2;             }
else
return 2;
}
left++;
right--;
}
return 0;
}
