#include <iostream>
#include <vector>
using namespace std;
vector<long long> arr;
vector<long long> tmp;
long long merge(int left, int mid, int right) {
int i = left, j = mid + 1, k = left, l;
long long inversion_cnt = 0;
while (i <= mid && j <= right) {
if (arr[i] <= arr[j]) {
tmp[k++] = arr[i++];
} else {
inversion_cnt += (long long)(mid - i + 1);
tmp[k++] = arr[j++];
}
}
if (i > mid) {
for (l = j; l <= right; l++, k++) {
tmp[k] = arr[l];
}
} else {
for (l = i; l <= mid; l++, k++) {
tmp[k] = arr[l];
}
}
for (l = left; l <= right; l++) {
arr[l] = tmp[l];
}
return inversion_cnt;
}
long long mergeSort(int left, int right) {
long long inversion_cnt = 0;
if (left < right) {
int mid = (left + right) / 2;
inversion_cnt += mergeSort(left, mid);
inversion_cnt += mergeSort(mid + 1, right);
inversion_cnt += merge(left, mid, right);
}
return inversion_cnt;
}
int main() {
ios_base::sync_with_stdio(0);
cin.tie(0);
int N;
cin >> N;
arr.resize(N);
tmp.resize(N);
for (int i = 0; i < N; i++) {
