#include <iostream>
#include <vector>
#include <queue>
#define MAX 50001
using namespace std;
int N, M;
vector<int> graph[MAX];
int parent[MAX];
int depth[MAX];
bool visited[MAX];
int max_depth = 0;
void BFS(int start) {
queue<int> q;
q.push(start);
depth[start] = 0;
visited[start] = true;
while (!q.empty()) {
int temp = q.front();
q.pop();
for (int i = 0; i < graph[temp].size(); i++) {
int next = graph[temp][i];
if (!visited[next]) {
visited[next] = true;
parent[next] = temp;
depth[next] = depth[temp] + 1;
if (depth[next] > max_depth) {
max_depth = depth[next];
}
q.push(next);
}
}
}
}
int findCommonParent(int a, int b) {
int a_d = depth[a];
int b_d = depth[b];
while (true) {
if (a_d > b_d) {
a_d--;
a = parent[a];
} else if (a_d < b_d) {
b_d--;
b = parent[b];
} else {
if (a == b) {
return a;
}
a_d--;
a = parent[a];
b_d--;
b = parent[b];
}
}
}
int main() {
cin >> N;
for (int i = 1; i < N; i++) {
int a, b;
cin >> a >> b;
graph[a].push_back(b);
graph[b].push_back(a);
}
BFS(1);
cin >> M;
for (int i = 0; i < M; i++) {
int a, b;
cin >> a >> b;
cout << findCommonParent(a, b) << endl;
}
return 0;
}

