vector<vector<int>> rotateArray(vector<vector<int>>& arr, int n, int m, int r) {
int repeat = min(n, m) / 2;
vector<vector<int>> result = arr;
while (r--) {
for (int size = 0; size < repeat; size++) {
int cntX = size, cntY = size;
int temp = result[cntX][cntY];
while (true) {
int prev = temp;
cntY++;
if (cntY >= m - size) {
cntY--;
break;
}
temp = result[cntX][cntY];
result[cntX][cntY] = prev;
}
while (true) {
int prev = temp;
cntX++;
if (cntX >= n - size) {
cntX--;
break;
}
temp = result[cntX][cntY];
result[cntX][cntY] = prev;
}
while (true) {
int prev = temp;
cntY--;
if (cntY < size) {
cntY++;
break;
}
temp = result[cntX][cntY];
result[cntX][cntY] = prev;
}
while (true) {
int prev = temp;
cntX--;
if (cntX < size) {
cntX++;
break;
}
temp = result[cntX][cntY];
result[cntX][cntY] = prev;
}
}
}
return result;
}
