int N;
int arr[21][21];
int like[401][4];
int dx[4] = {0, 0, 1, -1};
int dy[4] = {1, -1, 0, 0};
bool isInLikeStudent(int cur, int x, int y) {
for (int i = 0; i < 4; i++) {
if (like[cur][i] == arr[x][y])
return true;
}
return false;
}
int calculateSatisfaction(int cnt) {
if (cnt == 1) return 1;
if (cnt == 2) return 10;
if (cnt == 3) return 100;
if (cnt == 4) return 1000;
return 0;
}
pair<int, int> findEmptySeat(int cur) {
pair<int, int> res = make_pair(-1, -1);
int maxLikes = -1, maxEmpties = -1;
for (int i = 1; i <= N; i++) {
for (int j = 1; j <= N; j++) {
if (arr[i][j] != 0)
continue;
int likes = 0, empties = 0;
for (int k = 0; k < 4; k++) {
int nx = i + dx[k];
int ny = j + dy[k];
if (nx < 1 || nx > N || ny < 1 || ny > N)
continue;
if (arr[nx][ny] == 0) {
empties++;
} else if (isInLikeStudent(cur, nx, ny)) {
likes++;
}
}
if (likes > maxLikes) {
maxLikes = likes;
maxEmpties = empties;
res.first = i;
res.second = j;
} else if (likes == maxLikes) {
if (empties > maxEmpties) {
maxEmpties = empties;
res.first = i;
res.second = j;
}
}
}
}
return res;
}
int calculateTotalSatisfaction() {
int totalSatisfaction = 0;
for (int i = 1; i <= N; i++) {
for (int j = 1; j <= N; j++) {
int cur = arr[i][j];
int cnt = 0;
for (int k = 0; k < 4; k++) {
int nx = i + dx[k];
int ny = j + dy[k];
if (nx < 1 || nx > N || ny < 1 || ny > N)
continue;
if (isInLikeStudent(cur, nx, ny))
cnt++;
}
totalSatisfaction += calculateSatisfaction(cnt);
}
}
return totalSatisfaction;
}
int main() {
ios::sync_with_stdio(0);
cin.tie(0);
cin >> N;
for (int i = 1; i <= N * N; i++) {
int cur;
cin >> cur;
for (int j = 0; j < 4; j++) {
cin >> like[cur][j];
}
pair<int, int> emptySeat = findEmptySeat(cur);
arr[emptySeat.first][emptySeat.second] = cur;
}
cout << calculateTotalSatisfaction() << "\n";
return 0;
}

#include <iostream>
