#define maxN 100001
using namespace std;
int N, M;
vector<int> graph[maxN];
int parent[maxN][17];
int depth[maxN];
void dfs(int node, int parent_node) {
parent[node][0] = parent_node;
depth[node] = depth[parent_node] + 1;
for (int i = 1; i < 17; i++) {
parent[node][i] = parent[parent[node][i-1]][i-1];
}
for (int i = 0; i < graph[node].size(); i++) {
int next = graph[node][i];
if (next != parent_node) {
dfs(next, node);
}
}
}
int lca(int a, int b) {
if (depth[a] > depth[b]) {
swap(a, b);
}
for (int i = 16; i >= 0; i--) {
if (depth[b] - depth[a] >= (1 << i)) {
b = parent[b][i];
}
}
if (a == b) {
return a;
}
for (int i = 16; i >= 0; i--) {
if (parent[a][i] != parent[b][i]) {
a = parent[a][i];
b = parent[b][i];
}
}
return parent[a][0];
}
int main() {
