Visit[Dis - 1][Clip] = true;
Q.push(make_pair(make_pair(Dis - 1, Clip), Time + 1));
}
}
if (Clip > 0 && Dis + Clip < MAX){
if (Visit[Dis + Clip][Clip] == false){
Visit[Dis + Clip][Clip] = true;
Q.push(make_pair(make_pair(Dis + Clip, Clip), Time + 1));
}
}
}
}
