#include <queue>
#include <cstring>
#include <algorithm>
#define MAX 15
using namespace std;
int N, M, D;
int MAP[MAX][MAX];
int copyMap[MAX][MAX];
bool visited[MAX][MAX];
bool check[MAX][MAX];
int res = INT_MIN;
int dx[3] = {0, -1, 0}; int dy[3] = {-1, 0, 1};
void mapToCopy() {
memset(check, false, sizeof(check));
for(int i=0; i<N; i++){
for(int j=0; j<M; j++){
copyMap[i][j] = MAP[i][j];
}
}
}
void game(int a, int b, int c){
mapToCopy();
int archer[3] = {a, b, c};
int pos = N;
int kill = 0;
while(pos > 0){
for(int i=0; i<3; i++){
memset(visited, false, sizeof(visited));
int arX = pos;
int arY = archer[i];
queue<pair<int, int>> Q;
Q.push({arX-1, arY});
visited[arX-1][arY] = true;
while(!Q.empty()){
int nowX = Q.front().first;
int nowY = Q.front().second;
Q.pop();
if(copyMap[nowX][nowY] == 1){                     check[nowX][nowY] = true;
break;
}
for(int j=0; j<3; j++){
int nx = nowX + dx[j];
int ny = nowY + dy[j];
if(nx<0 || ny<0 || nx>=N || ny>=M) continue;
if(!visited[nx][ny] && (abs(arX-nx)+abs(arY-ny) <= D)){
visited[nx][ny] = true;
Q.push({nx, ny});
}
}
}
}
for(int i=0; i<N; i++){
for(int j=0; j<M; j++){
if(check[i][j]){
copyMap[i][j] = 0;
}
}
}
pos--;
}
for(int i=0; i<N; i++){
for(int j=0; j<M; j++){
if(check[i][j]){
kill++;
}
}
}
res = max(res, kill);
}
int main(){
ios_base::sync_with_stdio(0);
cin.tie(0);
cin >> N >> M >> D;
for(int i=0; i<N; i++){
for(int j=0; j<M; j++){
cin >> MAP[i][j];
}
}
for(int i=0; i<M-2; i++){
for(int j=i+1; j<M-1; j++){
for(int k=j+1; k<M; k++){
game(i, j, k);
}
}
}
cout << res;
return 0;
}

