#include <iostream>
#include <vector>
#include <queue>
#define INF 1e9
using namespace std;
int n, m, start, end;
int dist[1001];
int before[1001];
vector<pair<int, int>> graph[1001];
void dijkstra() {
priority_queue<pair<int, int>> pq;
pq.push(make_pair(0, start));
dist[start] = 0;
while(!pq.empty()) {
int cost = -pq.top().first;
int current = pq.top().second;
pq.pop();
if(dist[current] < cost) continue;
for(int i=0; i<graph[current].size(); i++) {
int next_cost = cost + graph[current][i].second;
int next_node = graph[current][i].first;
if(dist[next_node] > next_cost) {
dist[next_node] = next_cost;
pq.push(make_pair(-next_cost, next_node));
before[next_node] = current;
}
}
}
}
int main() {
ios_base::sync_with_stdio(0);
cin.tie(0), cout.tie(0);
cin >> n;
cin >> m;
for(int i=1; i<=n; i++) {
dist[i] = INF;
}
for(int i=0; i<m; i++) {
int a, b, c;
cin >> a >> b >> c;
graph[a].push_back(make_pair(b, c));
}
cin >> start >> end;
dijkstra();
vector<int> route;
route.push_back(end);
int val = before[end];
while(val) {
route.push_back(val);
val = before[val];
}
