if (nr >= 0 && nr < H && nc >= 0 && nc < W && map[nr][nc] == 0 && visited[nr][nc][k - 1] == -1) {
visited[nr][nc][k - 1] = cnt + 1;
q.push({ {nr, nc}, {k - 1, cnt + 1} });
}
}
