#include <iostream>
#include <vector>
#include <cmath>
#define INF 1000000001
using namespace std;
vector<int> Arr;
vector<pair<int, int>> Tree;
int initTreeMin(int Begin, int End, int Node) {
if (Begin == End) return Tree[Node].first = Arr[Begin];
int Mid = (Begin + End) / 2;
return Tree[Node].first = min(initTreeMin(Begin, Mid, Node * 2), initTreeMin(Mid + 1, End, Node * 2 + 1));
}
int initTreeMax(int Begin, int End, int Node) {
if (Begin == End) return Tree[Node].second = Arr[Begin];
int Mid = (Begin + End) / 2;
return Tree[Node].second = max(initTreeMax(Begin, Mid, Node * 2), initTreeMax(Mid + 1, End, Node * 2 + 1));
}
int findMin(int Begin, int End, int Node, int Left, int Right) {
if (Left > End || Right < Begin) return INF;
if (Left <= Begin && Right >= End) return Tree[Node].first;
int Mid = (Begin + End) / 2;
return min(findMin(Begin, Mid, Node * 2, Left, Right), findMin(Mid + 1, End, Node * 2 + 1, Left, Right));
}
int findMax(int Begin, int End, int Node, int Left, int Right) {
if (Left > End || Right < Begin) return -INF;
if (Left <= Begin && Right >= End) return Tree[Node].second;
int Mid = (Begin + End) / 2;
return max(findMax(Begin, Mid, Node * 2, Left, Right), findMax(Mid + 1, End, Node * 2 + 1, Left, Right));
}
int main() {
int N, M;
cin >> N >> M;
for (int i = 0; i < N; i++) {
int data;
cin >> data;
Arr.push_back(data);
}
Tree.resize(N * 4);
initTreeMin(0, N - 1, 1);
initTreeMax(0, N - 1, 1);
for (int i = 0; i < M; i++) {
int a, b;
cin >> a >> b;
cout << findMin(0, N - 1, 1, a - 1, b - 1) << " " << findMax(0, N - 1, 1, a - 1, b - 1) << endl;
}
return 0;
}

#include <iostream>
#include <vector>
#include <algorithm>
#define MAX 100 + 1
using namespace std;
struct Shark_Info{
int R;
int C;
int Speed;
int Direct;
int Size;
int Num;
};
int R, C, M, Answer;
vector<int> MAP[MAX][MAX];
vector<Shark_Info> Shark;
int dx[] = { 0, -1, 1, 0, 0 };
int dy[] = { 0, 0, 0, 1, -1 };
bool Standard(int A, int B){
if (Shark[A].Size > Shark[B].Size) return true;
return false;
}
void Input(){
cin >> R >> C >> M;
for (int i = 0; i < M; i++){
int r, c, s, d, z;
cin >> r >> c >> s >> d >> z;
Shark.push_back({ r,c,s,d,z,i });
MAP[r][c].push_back(i);
}
}
bool Check(){
for (int i = 0; i < Shark.size(); i++){
if (Shark[i].Size != 0) return false;
}
return true;
}
void Fishing(int Idx){
for (int i = 1; i <= R; i++){
if (MAP[i][Idx].size() != 0){
Answer = Answer + Shark[MAP[i][Idx][0]].Size;
Shark[MAP[i][Idx][0]].Size = 0;
MAP[i][Idx].clear();
break;
}
}
}
void Move_Shark(){
for (int i = 0; i < Shark.size(); i++){
if (Shark[i].Size == 0) continue;
int x = Shark[i].R;
int y = Shark[i].C;
MAP[x][y].clear();
}
for (int i = 0; i < Shark.size(); i++){
if (Shark[i].Size == 0) continue;
int x = Shark[i].R;
int y = Shark[i].C;
int Direct = Shark[i].Direct;
int Speed = Shark[i].Speed;
if (Direct == 1 || Direct == 2){
int Rotate = (R - 1) * 2;
if (Speed >= Rotate) Speed = Speed % Rotate;
for (int j = 0; j < Speed; j++){
int nx = x + dx[Direct];
int ny = y + dy[Direct];
if (nx < 1){
Direct = 2;
nx = nx + 2;
}
if (nx > R){
Direct = 1;
nx = nx - 2;
}
x = nx;
y = ny;
}
}
else{
int Rotate = (C - 1) * 2;
if (Speed >= Rotate) Speed = Speed % Rotate;
for (int j = 0; j < Speed; j++){
int nx = x + dx[Direct];
int ny = y + dy[Direct];
if (ny < 1){
Direct = 3;
ny = ny + 2;
}
if (ny > C){
Direct = 4;
ny = ny - 2;
}
x = nx;
y = ny;
}
}
Shark[i].R = x;
Shark[i].C = y;
Shark[i].Direct = Direct;
MAP[x][y].push_back(i);
}
}
void Kill_Shark(){
for (int i = 1; i <= R; i++){
for (int j = 1; j <= C; j++){
if (MAP[i][j].size() > 1){
sort(MAP[i][j].begin(), MAP[i][j].end(), Standard);
int Live_Index = MAP[i][j][0];
for (int k = 1; k < MAP[i][j].size(); k++){
Shark[MAP[i][j][k]].Size = 0;
Shark[MAP[i][j][k]].R = -1;
Shark[MAP[i][j][k]].C = -1;
}
MAP[i][j].clear();
MAP[i][j].push_back(Shark[Live_Index].Num);
}
}
}
}
void Solution(){
if (M == 0){
cout << 0 << endl;
return;
}
for (int i = 1; i <= C; i++){
if (Check() == true) break;
Fishing(i);
Move_Shark();
Kill_Shark();
}
cout << Answer << endl;
}
void Solve(){
Input();
Solution();
}
int main(void){
ios::sync_with_stdio(false);
cin.tie(NULL);
cout.tie(NULL);
Solve();
return 0;
}

