child[i] = NULL;
}
}
};
bool insert(TrieNode* root, string str) {
TrieNode* cur = root;
for (int i = 0; i < str.length(); i++) {
int idx = str[i] - '0';
if (cur->child[idx] == NULL) {
cur->child[idx] = new TrieNode();
}
if (cur->isEnd) {
return false;
}
cur = cur->child[idx];
}
cur->isEnd = true;
for (int i = 0; i < 10; i++) {
