void init_visit() {
for (int i = 0; i < N; i++)
for (int j = 0; j < M; j++)
visited[i][j] = 0;
}
int remain_cheese() {
int cnt = 0;
for (int i = 0; i < N; i++)
for (int j = 0; j < M; j++)
if (paper[i][j])
cnt++;
return cnt; }
void meltingCheese() {
for (int i = 0; i < N; i++) {
for (int j = 0; j < M; j++) {
if (paper[i][j] && visited[i][j] >= 2)
paper[i][j] = 0;         }
}
}
void relWithAir() {
queue<pair<int, int>> q;
q.push({0, 0});     visited[0][0] = 1;
while (!q.empty()) {
int cx = q.front().first;
int cy = q.front().second;
q.pop();
for (int i = 0; i < 4; i++) {
int nx = cx + moveD[i].x;
int ny = cy + moveD[i].y;
if (nx < 0 || N <= nx || ny < 0 || M <= ny)
continue;
if (paper[nx][ny] == 0 && visited[nx][ny] == 0) {
q.push({nx, ny});
visited[nx][ny] = 1;
}
else if (paper[nx][ny] == 1) {
visited[nx][ny]++;
}
}
}
}
