#include <vector>
#define INF 987654321
using namespace std;
int n;
vector<vector<int>> graph;
void input() {
graph.clear();
graph.resize(n);
for (auto& row : graph) {
row.resize(n);
for (auto& x : row)
cin >> x;
}
}
int sol() {
int dx[4] = {1, 0, -1, 0};
int dy[4] = {0, 1, 0, -1};
priority_queue<tuple<int, int, int>, vector<tuple<int, int, int>>, greater<tuple<int, int, int>>> pq;
int dist[125][125];
fill(&dist[0][0], &dist[124][124], INF);
bool visited[125][125] = {false,};
dist[0][0] = graph[0][0];
pq.push(make_tuple(dist[0][0], 0, 0));
while (!pq.empty()) {
auto[cur_dist, cur_x, cur_y] = pq.top();
pq.pop();
if (visited[cur_y][cur_x])
continue;
visited[cur_y][cur_x] = true;
for (int i = 0; i < 4; i++) {
int next_x = cur_x + dx[i], next_y = cur_y + dy[i];
if (next_x >= n || next_x < 0 || next_y >= n || next_y < 0)
continue;
if (dist[next_y][next_x] > dist[cur_y][cur_x] + graph[next_y][next_x]) {
dist[next_y][next_x] = dist[cur_y][cur_x] + graph[next_y][next_x];
pq.push(make_tuple(dist[next_y][next_x], next_x, next_y));
}
}
}
return dist[n - 1][n - 1];
}
