#include <iostream>
#include <queue>
using namespace std;
int N;
int arr[100][100];
long long dp[100][100];
int round_col[2] = {1, 0};
int round_row[2] = {0, 1};
void dp_calculate() {
dp[0][0] = 1;
for (int i = 0; i < N; i++) {
for (int j = 0; j < N; j++) {
if (dp[i][j] == 0 || (i == N-1 && j == N-1))
continue;
int move_val = arr[i][j];
for (int k = 0; k < 2; k++) {
int next_row = i + move_val * round_row[k];
int next_col = j + move_val * round_col[k];
if (next_row >= 0 && next_row < N && next_col >= 0 && next_col < N) {
dp[next_row][next_col] += dp[i][j];
}
}
}
}
}
int main() {
ios::sync_with_stdio(false);
cin.tie(NULL);
cout.tie(NULL);
cin >> N;
for (int i = 0; i < N; i++) {
for (int j = 0; j < N; j++) {
cin >> arr[i][j];
}
}
dp_calculate();
cout << dp[N-1][N-1] << endl;
return 0;
}

