#include<iostream>
#include<vector>
#include<algorithm>
#include<cmath>
using namespace std;
using ll = long long;
struct Segment{
vector<ll> tree;
vector<ll> seq;
Segment(ll n){
seq.resize(n+1);
ll log = ceil(log2(n));
ll t = (1LL<<(log+1));
tree.resize(t);
}
void init(ll node, ll s, ll e){
ll mid = (s+e)/2;
if(s==e)
tree[node] = seq[s];
else{
init(node*2, s, mid);
init(node*2+1, mid+1, e);
tree[node] = tree[node*2] + tree[node*2+1];
}
}
ll query(ll node, ll s, ll e, ll i, ll j){
ll mid = (s+e)/2;
if(i>e || j<s)
return 0;
if(i<=s && e<=j)
return tree[node];
return query(node*2, s, mid, i, j) + query(node*2+1, mid+1, e, i, j);
}
void update(ll node, ll s, ll e, ll i, ll u){
ll mid = (s+e)/2;
if(i<s || i>e)
return;
tree[node] += u;
if(s!=e){
update(node*2, s, mid, i, u);
update(node*2+1, mid+1, e, i, u);
}
}
};
int main(){
ios::sync_with_stdio(0);
cin.tie(0);
ll N, M, K;
ll a, b, c;
cin >> N >> M >> K;
Segment se(N);
for(int i=1; i<=N; i++)
cin >> se.seq[i];
se.init(1, 1, N);
int aa = M + K;
while(aa--){
cin >> a >> b >> c;
if(a==1){
se.update(1, 1, N, b, c-se.seq[b]);
se.seq[b] = c;
}
else
cout << se.query(1, 1, N, b, c) << "\n";
}
}

#include<iostream>
#include<queue>
#include<vector>
using namespace std;
int map[100][100];
int cost[100][100];
int X[4] = {1, -1, 0, 0};
int Y[4] = {0, 0, 1, -1};
priority_queue<pair<int, pair<int, int>>> pq;
int main(void){
int n, m;
int x, y, cnt;
int next_x, next_y, next_cnt;
scanf("%d%d", &m, &n);
for(int i=0; i<n; i++){
for(int j=0; j<m; j++){
scanf("%1d", &map[i][j]);
cost[i][j] = -1;
}
}
cost[0][0] = 0;
pq.push(make_pair(0, make_pair(0, 0)));
while(!pq.empty()){
cnt = -pq.top().first;
x = pq.top().second.first;
y = pq.top().second.second;
pq.pop();
if(cost[x][y] < cnt) continue;
for(int i=0; i<4; i++){
next_x = x + X[i];
next_y = y + Y[i];
next_cnt = cnt + map[next_x][next_y];
if(next_x < 0 || next_x >= n || next_y < 0 || next_y >= m)
continue;
if(cost[next_x][next_y] == -1){
cost[next_x][next_y] = next_cnt;
pq.push(make_pair(-next_cnt, make_pair(next_x, next_y)));
}
else if(cost[next_x][next_y] > next_cnt){
cost[next_x][next_y] = next_cnt;
pq.push(make_pair(-next_cnt, make_pair(next_x, next_y)));
}
}
}
printf("%d\n", cost[n-1][m-1]);
return 0;
}

