int ans = 9e8;
void bt(int depth, int start, int prev, int cost) {
if (depth == N) {
if (g[prev][start] == 0)
return;
cost += g[prev][start];
ans = min(ans, cost);
return;
}
for (int i = 0; i < N; i++) {
if (visit[i] || g[prev][i] == 0)
continue;
visit[i] = 1;
bt(depth + 1, start, i, cost + g[prev][i]);
visit[i] = 0;
}
}
