using namespace std;
int R, C, T;
int room[51][51];
int temp[51][51];
int cleaner_top, cleaner_bottom;
int dx[4] = {0, 1, 0, -1};
int dy[4] = {-1, 0, 1, 0};
void spreadDust() {
for (int i = 0; i < R; i++) {
for (int j = 0; j < C; j++) {
if (room[i][j] > 0) {
int cnt = 0;
for (int k = 0; k < 4; k++) {
int nx = i + dx[k];
int ny = j + dy[k];
if (nx >= 0 && nx < R && ny >= 0 && ny < C && room[nx][ny] != -1) {
temp[nx][ny] += room[i][j] / 5;
cnt++;
}
}
temp[i][j] += room[i][j] - (room[i][j] / 5) * cnt;
}
}
}
for (int i = 0; i < R; i++) {
for (int j = 0; j < C; j++) {
room[i][j] = temp[i][j];
temp[i][j] = 0;
}
}
}
void moveTopCleaner() {
int x = cleaner_top - 1;
while (x > 0) {
room[x][0] = room[x - 1][0];
x--;
}
for (int i = 0; i < C - 1; i++) {
room[0][i] = room[0][i + 1];
}
for (int i = 0; i < cleaner_top; i++) {
room[i][C - 1] = room[i + 1][C - 1];
}
for (int i = C - 1; i > 1; i--) {
room[cleaner_top][i] = room[cleaner_top][i - 1];
}
room[cleaner_top][1] = 0;
}
void moveBottomCleaner() {
int x = cleaner_bottom + 1;
while (x < R - 1) {
room[x][0] = room[x + 1][0];
x++;
}
for (int i = 0; i < C - 1; i++) {
room[R - 1][i] = room[R - 1][i + 1];
}
for (int i = R - 1; i > cleaner_bottom; i--) {
room[i][C - 1] = room[i - 1][C - 1];
}
for (int i = C - 1; i > 1; i--) {
room[cleaner_bottom][i] = room[cleaner_bottom][i - 1];
}
room[cleaner_bottom][1] = 0;
}
void solve() {
while (T--) {
spreadDust();
moveTopCleaner();
moveBottomCleaner();
}
int ans = 0;
for (int i = 0; i < R; i++) {
for (int j = 0; j < C; j++) {
if (room[i][j] > 0) {
ans += room[i][j];
}
}
}
cout << ans << endl;
}
int main() {
cin >> R >> C >> T;
int idx = 0;
for (int i = 0; i < R; i++) {
for (int j = 0; j < C; j++) {
cin >> room[i][j];
if (room[i][j] == -1) {
if (idx == 0) {
cleaner_top = i;
idx++;
} else {
cleaner_bottom = i;
}
}
}
}
solve();
return 0;
}

