int ny = j + dir[k][1];
if (nx < 0 || ny < 0 || nx >= N || ny >= M) continue;
if (graph[nx][ny] == 0) {
waterCnt++;
}
}
int val = graph[i][j] - waterCnt;
if (val > 0) tmp[i][j] = val;
}
}
for (int i = 0; i < N; i++) {
for (int j = 0; j < M; j++) {
graph[i][j] = tmp[i][j];
}
}
}
