#include <iostream>
#include <queue>
#include <cstring>
using namespace std;
int N, M;
char map[10][10];
bool visit[10][10][10][10];
struct ball {
int rx, ry, bx, by, count;
};
int dx[] = {1,-1,0,0};
int dy[] = {0,0,1,-1};
void move(int& x, int& y, int& distance, int& i) {
while (map[x+dx[i]][y+dy[i]] != '#' && map[x][y] != 'O') {
x += dx[i];
y += dy[i];
distance += 1;
}
}
int BFS(int rx, int ry, int bx, int by) {
queue<ball> q;
q.push({rx, ry, bx, by, 0});
visit[rx][ry][bx][by] = true;
while (!q.empty()) {
int rx = q.front().rx;
int ry = q.front().ry;
int bx = q.front().bx;
int by = q.front().by;
int count = q.front().count;
q.pop();
if (count >= 10) break;
for (int i = 0; i < 4; i++) {
int nrx = rx, nry = ry, nbx = bx, nby = by;
int rc = 0, bc = 0, ncount = count + 1;
move(nrx, nry, rc, i);
move(nbx, nby, bc, i);
if (map[nbx][nby] == 'O') continue;
if (map[nrx][nry] == 'O') {
return ncount;
}
if (nrx == nbx && nry == nby) {
if (rc > bc) nrx -= dx[i], nry -= dy[i];
else nbx -= dx[i], nby -= dy[i];
}
if (visit[nrx][nry][nbx][nby]) continue;
visit[nrx][nry][nbx][nby] = true;
q.push({nrx, nry, nbx, nby, ncount});
}
}
return -1;
}
void solve() {
cin >> N >> M;
int rx = 0, ry = 0, bx = 0, by = 0;
for (int i = 0; i < N; i++) {
for (int j = 0; j < M; j++) {
cin >> map[i][j];
if (map[i][j] == 'R') {
rx = i;
ry = j;
} else if (map[i][j] == 'B') {
bx = i;
by = j;
}
}
}
int answer = BFS(rx, ry, bx, by);
cout << answer << endl;
}
int main() {
ios_base::sync_with_stdio(false);
cin.tie(NULL);
solve();
return 0;
}

