vector<int> home;
int binarySearch(int n, int c){
int r = home[n-1];
int l = 1;
int ans = 0;
while (l <= r){
int cnt = 1;
int mid = (r + l) / 2;
int start = home[0];
for (int i = 1; i < n; i++)
if (home[i] - start >= mid)
start = home[i], cnt++;
if (cnt >= c)
ans = mid, l = mid + 1;
else
r = mid - 1;
}
return ans;
}
