bool solveSudoku(int x, int y) {
if (x == 8 && y == 9) {
printBoard();
return true;
}
if (y == 9) {
x++;
y = 0;
}
if (board[x][y] == 0) {
for (int num = 1; num <= 9; num++) {
if (!row[x][num] && !col[y][num] && !square[x/3][y/3][num]) {
board[x][y] = num;
row[x][num] = true;
col[y][num] = true;
square[x/3][y/3][num] = true;
if (solveSudoku(x, y+1))
return true;
board[x][y] = 0;
row[x][num] = false;
col[y][num] = false;
square[x/3][y/3][num] = false;
}
}
} else {
if (solveSudoku(x, y+1))
return true;
}
return false;
}
