vector<pair<int,int>> g[MAX]; priority_queue<pair<int,int>> pq; vector<int> dist(MAX,INF);
int src, dst;
void dijkstra(){
pq.push({0,src});
dist[src]=0;
while(!pq.empty()){
int cur=pq.top().second;
int cost=-pq.top().first;
pq.pop();
if(dist[cur]<cost)
continue;
for(int i=0;i<g[cur].size();i++){
int next=g[cur][i].first;
int nCost=g[cur][i].second+cost;
if(dist[next]>nCost){
dist[next]=nCost;
pq.push({-nCost,next});
}
}
}
}
