int BFS() {
int x, y, next_x, next_y;
Q.push({{1,1},1});
visit[1][1][1] = 1;
while (!Q.empty()) {
y = Q.front().first.first;
x = Q.front().first.second;
breakable = Q.front().second;
Q.pop();
