queue<pair<int, int>> q;
q.push({i, j});
check[i][j] = 1;
while(!q.empty()) {
int x = q.front().first;
int y = q.front().second;
q.pop();
for(int i=0; i<4; i++) {
int nx = x + dx[i];
int ny = y + dy[i];
if(0 > nx || nx >= n || 0 > ny || ny >= n)
continue;
if(!safeArea[nx][ny])
continue;
if(!check[nx][ny]) {
check[nx][ny] = 1;
q.push({nx, ny});
}
}
}
}
