#include <iostream>
#include <vector>
#include <queue>
#include <limits>
#define INF std::numeric_limits<int>::max()
int V, E, K;
std::vector<std::pair<int, int>> adj[20001];
std::vector<int> dist;
void dijkstra() {
dist.resize(V + 1, INF);
dist[K] = 0;
std::priority_queue<std::pair<int, int>, std::vector<std::pair<int, int>>, std::greater<std::pair<int, int>>> pq;
pq.push(std::make_pair(0, K));
while (!pq.empty()) {
auto cur = pq.top();
pq.pop();
int curDist = cur.first;
int curNode = cur.second;
if (dist[curNode] != curDist) continue;
for (auto& nxt : adj[curNode]) {
int cost = nxt.first;
int nxtNode = nxt.second;
if (dist[nxtNode] > curDist + cost) {
dist[nxtNode] = curDist + cost;
pq.push(std::make_pair(dist[nxtNode], nxtNode));
}
}
}
}
int main() {
std::ios::sync_with_stdio(false);
std::cin.tie(nullptr);
std::cout.tie(nullptr);
std::cin >> V >> E >> K;
for (int i = 0; i < E; i++) {
int u, v, w;
std::cin >> u >> v >> w;
adj[u].push_back(std::make_pair(w, v));
}
dijkstra();
for (int i = 1; i <= V; i++) {
if (dist[i] == INF) {
std::cout << "INF" << std::endl;
} else {
std::cout << dist[i] << std::endl;
}
}
return 0;
}

