int combination(int n, int r) {
int memo[n+1][r+1];
for(int i=0;i<=n;i++){
for(int j=0;j<=min(i, r);j++){
if(j==0 || j==i)
memo[i][j]=1;
else
memo[i][j]=memo[i-1][j-1]+memo[i-1][j];
}
}
return memo[n][r];
}
