vector<int> a;
int solve(int num){
int mid, right, left;
right = a.size() - 1;
left = 0;
mid = (right + left) / 2;
int result = 0;
while(right - left >= 0){
if(a[mid] == num){
result = 1;
break;
}
else if(a[mid] > num){
right = mid - 1;
}
else if(a[mid] < num){
left = mid + 1;
}
mid = (right + left) / 2;
}
return result;
}
